(6, 'Teknik Mesin', 'ME', 'Teknik_Mesin.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:960/540;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-MESIN-2023.png\" width=\"960\" height=\"540\"></figure><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);\">Menjadi Jurusan yang berwawasan Internasional dalam Penerapan Teknologi untuk menciptakan Alumni dan Karya Unggul</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Membuat program yang sesuai dengan Kebutuhan Masyarakat melalui Pendidikan dan Penelitian.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan Pengabdian Kepada Masyarakat dan Kerjasama Industri dengan cara membuat Teaching Factory dan penerapan Revolusi Industri 4.0</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Mempunyai Karya Bermutu dan Prestasi Internasional</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mempunyai Program Tersertifikasi dan Praktisi Mengajar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mempunyai Kurikulum Terintegrasi dan Teaching Factory</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menerapkan Revolusi Industri 4.0 dan memperbaiki Manajemen Jurusan</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Strategi</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menciptakan Alumni dan Karya Bermutu sesuai Kebutuhan Masyarakat dan Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Berusaha meraih prestasi akademik dan non akademik pada tingkat internasional</span></li><li><span style=\"color:hsl(0,0%,0%);\">Membuat Program Tersertifikasi untuk menunjang MBKM</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengundang Praktisi mengajar dari Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperbaiki Kurikulum sesuai dengan Produk Unggulan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan Teaching Factory untuk menjalin Kerjasama Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperbaiki Hubungan Industri dengan menerapkan Revolusi Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperbaiki Manajemen Jurusan untuk menuju Akreditasi Internasional</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Motto</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Creative, Communicative and International Perspective</span></p>', 'https://me.pnp.ac.id/', '2023-11-25 00:32:59', '2023-12-03 03:12:59'),
(9, 'Teknik Sipil', 'SP', 'Teknik_Sipil.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:960/540;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-SIPIL-2023.png\" width=\"960\" height=\"540\"></figure><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi, Misi, Tujuan dan Sasaran</strong></span></h2><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>Pada tahun 2025 menjadi unit pengelola program studi vokasional teknik sipil yang bermartabat, andal,unggul dan berstandar internasionl</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>1. Mengelola Program Studi pendidikan vokasional yang inovatif , aplikatif dan adaptif untuk menghasilkan lulusan yang kompeten, berjiwa kewirausahaan dan berwawasan internasional.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>2. Melaksanakan program penelitian yang bermanfaat bagi masyarakat dan berkonstribusi pada pengembangan keilmuan terapan serta pencapaian hak atas kekayaan intelektual (HKI) dan paten.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>3. Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat .</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>4. Menjalin kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan, dan dunia usaha di tingkat nasional dan internasional.</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Berdasarkan visi dan misi yang telah ditetapkan, tujuan yang ingin dicapai oleh Unit Pengelola Program Studi vokasional teknik Sipil adalah :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menjadikan program studi yang unggul dilingkungannya agar lulusannya bertaqwa kepada Tuhan Yang Maha Esa, bermartabat, kompeten, dan mendapatkan pengakuan secara nasional dan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian yang bermanfaat untuk pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten untuk mendukung kemandirian bangsa</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pelayanan melalui penyediaan fasilitas, prasarana, sarana dan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperluas dan meningkatkan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mewujudkan pengembangan Program Studi Vokasi yang relevan dengan industri jasa konstruksi yang berkualitas dan berkesinambungan</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Untuk mencapai tujuan tersebut, maka Unit Pengelola Program Studi Vokasional Teknik Sipil menetapkan 9 sasaran strategi sebagai berikut :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya sarana dan prasarana serta fasilitas pendukung proses pembelajaran yang menekankan pada penguasaan keahlian terapan dan berjiwa kewirausahaan;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terbentuknya organ-organ penyelenggara Jurusan Teknik Sipil dan tata kelola organisasi yang tangguh, mandiri dan terpadu;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya kualitas lulusan berbasis kompetensi, daya saing dan bermartabat di tingkat nasional maupun internasional;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya penelitian aplikatif yang bermanfaat dalam pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya mutu pelayanan melalui manajemen yang efektif dan efesien bagi civitas dengan menerapkan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Ada peningkatan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terwujudnya program studi baru yang relevan untuk memenuhi kebutuhan industri dan masyarakat</span></li></ol>', 'https://sipil.pnp.ac.id/', '2023-11-27 09:56:59', '2023-12-03 03:13:38'),
(10, 'Teknik Elektro', 'EE', 'Teknik_Elektro.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>', 'https://elektro.pnp.ac.id/', '2023-11-27 10:01:39', '2023-12-03 03:14:10'),
(11, 'Administrasi Niaga', 'AN', 'Administrasi_Niaga.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ADMINISTRASI-NIAGA-2023a.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Administrasi Niaga</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Adminisitrasi Niaga berdiri pada tahun 1997 berdasarkan Surat Keputusan Direktorat Jenderal Pendidikan Tinggi nomor 190/Dikti/Kep/1997. Melalui Program Studi Administrasi Bisnis, jurusan Administrasi Niaga bertransformasi menjadi salah satu jurusan dengan peminat tertinggi setiap tahunnya di Politeknik Negeri Padang. Pada tahun 2008, untuk mengakomodir tuntutan kebutuhan industri perjalanan wisata di Sumatera Barat yang sangat besar maka didirikanlah Program Studi Usaha Perjalanan Wisata.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">TUJUAN</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga Ahli Madya profesional dalam bidang kesekretariatan dan administrasi perkantoran sesuai dengan kebutuhan dunia usaha dan dunia industri yang berkeahlian tinggi dalam menagani operasi perkantoran dan berwawasan konseptual yang baik untuk mengembangkan sistem perkantoran bisnis secara menyeluruh.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang dalam merancang tour, baik inbound maupun outbond, melakukan reservasi dan dokumentasi tour, melakukan pemanduan (<i>guiding</i>) wisata.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang handal sebagai Pengelola Objek dan daya tarik wisata (DMO), Tenaga ahli di konsultan pariwisata (peneliti muda, asisten peneliti, tenaga lapangan), Manager Sales dan Marketing Pariwisata, Event Organizer, Entrepreneur di Industri Pariwisata dan Hospitaliti, dan Peneliti di Bidang Pariwisata.</span></li></ol>', 'http://an.pnp.ac.id/', '2023-11-27 10:09:01', '2023-12-03 03:53:17'),
(12, 'Akuntansi', 'AK', 'Akuntansi.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/AKUNTANSI-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Akuntansi</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Akuntansi Politeknik Negeri Padang (PNP) berdiri sejak tahun 1997 dan merupakan satu-satunya lembaga pendidikan tinggi vokasi bidang akuntansi di Sumatera Barat yang menyelenggarakan pendidikan vokasi pada jenjang Magister Terapan (S2), Diploma IV (Terakreditasi A) dan Diploma III (Unggul).</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Proses pembelajaran di Jurusan Akuntansi sepenuhnya mengacu pada filosofi pengajaran vokasi (Politeknik) yang lebih menekankan pada penguasaan hard skill dan soft skill mahasiswa dengan komposisi jam perkuliahan praktik (60%) dan jam perkuliahan teori (40%).</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Penerapan Kurikulum Berbasis Kompetensi (KBK) dan penyusunan kurikulum disesuaikan dengan KKNI (Kerangka Kualifikasi Nasional Indonesia) sehingga kurikulum dirancang dengan mempertimbangkan kebutuhan pengguna lulusan.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Kerjasama dengan industri diwujudkan dalam bentuk MoU dengan industri pengguna lulusan seperti Kantor Akuntan Publik (KAP), BUMN, BUMD, serta instansi pemerintah dan swasta.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">TUJUAN</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menciptakan lulusan yang mampu dan terampil dalam bidang seperti: Asistant Accounting, Financial Computer System, Internal Auditor, Asistant Auditor, Asistant Analisis System, menghitung dan membuat laporan pajak,</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki keahlian dan wawasan dibidang akuntansi, audit, pajak dan keuangan secara integrasi dan komprehensif yang bisa diterapkan pada perusahaan swasta, instansi pemerintah maupun lembaga keuangan baik berskala nasional maupun internasional.</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">FASILITAS</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer Akuntasi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Akuntansi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Kerja Anggaran Manufaktur</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Akuntansi Pemeriksaan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Anggaran</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Sistem Informasi Akuntansi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Anggaran Bank Mini</span></li></ol>', 'https://akuntansi.pnp.ac.id/', '2023-11-27 10:12:03', '2023-12-03 03:28:09'),
(13, 'Bahasa Inggris', 'BI', 'Bahasa_Inggris.jpg', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ENGLISH-DEPARTMENT-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Bahasa Inggris</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki kemampuan berfikir kritis, analitis dan memiliki rasa kepercayaan diri yang tinggi dan keterampilan berkomunikasi dalam bahasa Inggris dengan baik secara lisan dan tulisan untuk memenuhi kepentingan dunia usaha dan dunia industri, konsep, teknik dan keterampilan penerjemahan dari bahasa inggris ke bahasa indonesia dan sebaliknya,l serta keterampilan berbahasa inggris lisan dan tulisan dalm bidang komunikasi ( MC, Host, Spokesperson, News Reader, Reporter, Journalist,etc).</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">FASILITAS</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Bahasa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Multimedia</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Translation</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini TV</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini Radio</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Sitim pendidikan:</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Perkuliahn diberikan dengan metode pembelajaran Blended Learning dengan presentase 60 % praktek dan 40% teori.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Perkuliahan diampu oleh dosen tetap dari jurusan Bahasa Inggris PNP dan para praktisi dari industri.</span></p>', 'https://bing.pnp.ac.id/', '2023-11-27 10:16:21', '2023-12-03 03:57:49'),
(14, 'Teknologi Informasi', 'TI', 'Teknologi_Informasi.png', '<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/Teknologi-Informasi-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Teknologi Informasi</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga professional tingkat ahli madya di bidang Teknologi Informasi, khususnya pengelolaan informasi berbasis komputer sehingga mampu bekerja di berbagai instansi, perkantoran organisasi dan bisnis modern.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Pada tahun 2025 menjadi institusi pendidikan vokasional terbaik tingkat nasional dibidang Teknologi Informasi, Bermartabat dan berwawasan Internasional</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi :</strong></span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan pendidikan vokasional dibidang Teknologi Informasi yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi yang berwawasan Internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelanggarakan penelitian yang inovatif dan adaptif dibidang Teknologi Informasi untuk pengembangan ilmu pengetahuan dan teknologi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menerapkan ilmu pengetahuan dan teknologi dalam rangka memecahkan masalah dan meningkatkan taraf hidup masyarakat dibidang Teknologi Informasi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menjalin kerjasama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan dan dunai usaha ditingkat Nasional dan Internasional dibidang Teknologi Informasi.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Teknologi Informasi memiliki empat tujuan yang merupakan turunan dari tujuan Politeknik Negeri Padang yang, sebagai berikut:</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan dibidang Teknologi Informasi yang kompeten, berdaya saing antar bangsa, bermartabat dan dan bertaqwa kepada Tuhan Yang Maha Esa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan penelitian dibidang Teknologi Informasi yang bermanfaat dan pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan karya pengabdian kepada masyarakat dibidang Teknologi Informasi yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Terwujudnya kerjasama dengan berbagai pihak, baik dalam maupun luar negeri yang saling menguntungkan</span></li></ol>', 'https://ti.pnp.ac.id/', '2023-11-27 10:20:07', '2023-12-03 03:38:06');

