 bidang telekomunikasi sesuai dengan kebutuhan industri.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menjadi pusat pendidikan vokasi dalam pengembangan iptek terapan dibidang teknologi jaringan seluler dan Internet of Things (IoT).</span><br><span style=\"color:hsl(0,0%,0%);\">2.&nbsp; Mengahasilkan lulusan Sarjana Terapan (Diploma 4) yang profesional dibidang jaringan telekomunikasi seluler dan IoT.</span><br><span style=\"color:hsl(0,0%,0%);\">3. Menghasilkan penelitian dan PkM serta luarannya ditingkat nasional dan internasional.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Tercapainya pelaksanaan tri dharma Perguruan Tinggi oleh sivitas akademika Program Studi Sarjana Terapan Teknik Telekomunikasi yang dapat diterapkan pada masyarakat sesuai dengan perkembangan iptek.</span></p>\";s:4:\"logo\";s:28:\"D4_Teknik_Telekomunikasi.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T08:42:52.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:45:19.000000Z\";}', 'a:8:{s:2:\"id\";i:10;s:4:\"nama\";s:14:\"Teknik Elektro\";s:4:\"kode\";s:2:\"EE\";s:4:\"logo\";s:18:\"Teknik_Elektro.jpg\";s:9:\"deskripsi\";s:3652:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>\";s:7:\"website\";s:26:\"https://elektro.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:01:39.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:14:10.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";a:2:{s:4:\"nama\";s:20:\"D3 Teknik Alat Berat\";s:10:\"id_jurusan\";i:6;}s:3:\"3ME\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Mesin\";s:10:\"id_jurusan\";i:6;}s:5:\"4TMAN\";a:2:{s:4:\"nama\";s:20:\"D4 Teknik Manufaktur\";s:10:\"id_jurusan\";i:6;}s:4:\"4RPM\";a:2:{s:4:\"nama\";s:31:\"D