ai\";i:48;s:9:\"peringkat\";i:13;}s:3:\"3ME\";a:2:{s:5:\"nilai\";i:0;s:9:\"peringkat\";i:14;}s:3:\"3AK\";a:2:{s:5:\"nilai\";i:-24;s:9:\"peringkat\";i:15;}s:5:\"4TMAN\";a:2:{s:5:\"nilai\";i:-32;s:9:\"peringkat\";i:16;}s:3:\"3BI\";a:2:{s:5:\"nilai\";i:-36;s:9:\"peringkat\";i:17;}s:4:\"4RPM\";a:2:{s:5:\"nilai\";i:-40;s:9:\"peringkat\";i:18;}s:3:\"4AK\";a:2:{s:5:\"nilai\";i:-48;s:9:\"peringkat\";i:19;}s:4:\"3TAB\";a:2:{s:5:\"nilai\";i:-66;s:9:\"peringkat\";i:20;}s:3:\"3AB\";a:2:{s:5:\"nilai\";i:-96;s:9:\"peringkat\";i:21;}s:3:\"4DP\";a:2:{s:5:\"nilai\";i:-110;s:9:\"peringkat\";i:22;}s:4:\"4UPW\";a:2:{s:5:\"nilai\";i:-110;s:9:\"peringkat\";i:23;}s:3:\"4BI\";a:2:{s:5:\"nilai\";i:-122;s:9:\"peringkat\";i:24;}s:4:\"4LPI\";a:2:{s:5:\"nilai\";i:-192;s:9:\"peringkat\";i:25;}}', '4TRIL', 'a:9:{s:2:\"id\";i:28;s:10:\"id_jurusan\";i:10;s:4:\"kode\";s:5:\"4TRIL\";s:4:\"nama\";s:39:\"D4 Teknologi Rekayasa Instalasi Listrik\";s:10:\"akreditasi\";s:8:\"C / Baik\";s:9:\"deskripsi\";s:2881:\"<p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Menghasilkan Tenaga Ahli Vokasi dibidang Teknologi Rekayasa Instalasi Listrik terbaik di Wilayah Indonesia Bagian Barat pada tahun 2026.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi</strong></span></p><ol><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan sesuai kompetensi Teknologi Rekayasa Instalasi Listrik dalam rangka mewujudkan Visi.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Mengembangkan ilmu terapan di bidang Teknologi Rekayasa Instalasi Listrik sesuai bidang kompetensi yang dibutuhkan.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Menjalin hubungan kerjasama dengan industri dan institusi tekait dalam rangka <i><strong>link and match </strong></i>sistem pembelajaran dan sarana praktek industri.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Meningkatkan Kompetensi Mutu Pendidikan Vokasi dibidang Teknologi Rekayasa Instalasi Listrik didalam mewujudkan dunia kerja mandiri.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Tujuan Program Studi D IV Teknologi Rekayasa Instalasi Listrik Politeknik Negeri Padang adalah menghasilkan lulusan vokasional didalam mengembangkan keahlian dibidang Teknologi&nbsp; Rekayasa Instalasi Listrik yang cerdas, bermartabat, kompetitif, mandiri yang berjiwa kewirausahaan.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Sasaran &nbsp;pencapaian yang dilaksanakan saat ini, yakni memperkuat program studi dalam&nbsp; &nbsp;mengelola&nbsp; sistem&nbsp; &nbsp;pendidikan&nbsp; &nbsp;vokasional,&nbsp; &nbsp;sehingga&nbsp; &nbsp;menjadi&nbsp; &nbsp;pusat pengembangan tenaga kerja yang kompeten dibidangnya.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D.4 Teknologi Rekayasa Instalasi Listrik</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Instalasi Listrik</span></li></ul>\";s:4:\"logo\";s:43:\"D4_Teknologi_Rekayasa_Instalasi_Listrik.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T08:47:25.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:45:46.000000Z\";}', 'a:8:{s:2:\"id\";i:10;s:4:\"nama\";s:14:\"Teknik Elektro\";s:4:\"kode\";s:2:\"EE\";s:4:\"logo\";s:18:\"Teknik_Elektro.jpg\";s:9:\"deskripsi\";s:3652:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>\";s:7:\"website\";s:26:\"https://elektro.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:01:39.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:14:10.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";a:2:{s:4:\"nama\";s:20:\"D3 Teknik Alat Berat\";s:10:\"id_jurusan\";i:6;}s:3:\"3ME\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Mesin\";s:10:\"id_jurusan\";i:6;}s:5:\"4TMAN\";a:2:{s:4:\"nama\";s:20:\"D4 Teknik Manufaktur\";s:10:\"id_jurusan\";i:6;}s:4:\"4RPM\";a:2:{s:4:\"nama\";s:31:\"D4 Rekayasa Perancangan Mekanik\";s:10:\"id_jurusan\";i:6;}s:3:\"3SP\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Sipil\";s:10:\"id_jurusan\";i:9;}s:4:\"4MRK\";a:2:{s:4:\"nama\";s:32:\"D4 Manajemen Rekayasa Konstruksi\";s:10:\"id_jurusan\";i:9;}s:4:\"4PJJ\";a:2:{s:4:\"nama\";s:33:\"D4 Perancangan Jalan Dan Jembatan\";s:10:\"id_jurusan\";i:9;}s:5:\"4TPIR\";a:2:{s:4:\"nama\";s:38:\"D4 Teknik Perencanaan Irigasi Dan Rawa\";s:10:\"id_jurusan\";i:9;}s:3:\"3EC\";a:2:{s:4:\"nama\";s:21:\"D3 Teknik Elektronika\";s:10:\"id_jurusan\";i:10;}s:3:\"3EL\";a:2:{s:4:\"nama\";s:17:\"D3 Teknik Listrik\";s:10:\"id_jurusan\";i:10;}s:3:\"3TC\";a:2:{s:4:\"nama\";s:24:\"D3 Teknik Telekomunikasi\";s:10:\"id_jurusan\";i:10;}s:3:\"4EC\";a:2:{s:4:\"nama\";s:21:\"D4 Teknik Elektronika\";s:10:\"id_jurusan\";i:10;}s:3:\"4TC\";a:2:{s:4:\"nama\";s:24:\"D4 Teknik Telekomunikasi\";s:10:\"id_jurusan\";i:10;}s:5:\"4TRIL\";a:2:{s:4:\"nama\";s:39:\"D4 Teknologi Rekayasa Instalasi Listrik\";s:10:\"id_jurusan\";i:10;}s:3:\"3AB\";a:2:{s:4:\"nama\";s:22:\"D3 Administrasi Bisnis\";s:10:\"id