\";a:2:{s:5:\"nilai\";i:22;s:9:\"peringkat\";i:14;}s:3:\"3AK\";a:2:{s:5:\"nilai\";i:-16;s:9:\"peringkat\";i:15;}s:5:\"4TMAN\";a:2:{s:5:\"nilai\";i:-28;s:9:\"peringkat\";i:16;}s:4:\"4RPM\";a:2:{s:5:\"nilai\";i:-30;s:9:\"peringkat\";i:17;}s:4:\"3TAB\";a:2:{s:5:\"nilai\";i:-54;s:9:\"peringkat\";i:18;}s:3:\"4AK\";a:2:{s:5:\"nilai\";i:-62;s:9:\"peringkat\";i:19;}s:3:\"3BI\";a:2:{s:5:\"nilai\";i:-94;s:9:\"peringkat\";i:20;}s:3:\"3AB\";a:2:{s:5:\"nilai\";i:-122;s:9:\"peringkat\";i:21;}s:3:\"4DP\";a:2:{s:5:\"nilai\";i:-160;s:9:\"peringkat\";i:22;}s:4:\"4UPW\";a:2:{s:5:\"nilai\";i:-160;s:9:\"peringkat\";i:23;}s:3:\"4BI\";a:2:{s:5:\"nilai\";i:-178;s:9:\"peringkat\";i:24;}s:4:\"4LPI\";a:2:{s:5:\"nilai\";i:-240;s:9:\"peringkat\";i:25;}}', '4EC', 'a:9:{s:2:\"id\";i:26;s:10:\"id_jurusan\";i:10;s:4:\"kode\";s:3:\"4EC\";s:4:\"nama\";s:21:\"D4 Teknik Elektronika\";s:10:\"akreditasi\";s:10:\"A / Unggul\";s:9:\"deskripsi\";s:2630:\"<p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Pada tahun 2039 Program Studi Sarjana Saint Terapan Teknik Elektronika (PSSTTE) &nbsp;menjadi lembaga pendidikan vokasional yang unggul dibidang Sistem Kontrol dan Instrumentasi industry</span></p><p>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi Keilmuan Program Studi Sarjana Terapan Teknik Elektronika (PSSTTE)</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan vokasional melalui pengembangan tenaga pendidik dan kependidikan sesuai dengan perkembangan ilmu pengetahuan dan teknologi dibidang teknik elektro khususnya bidang Sistem Kontrol dan Intrumentasi Industri</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan kualitas dan kuantitas penelitian dan pengabdian masyarakat dalam bidang ilmu pengetahuan dan teknologi bidang Sistem Kontrol dan Intrumentasi Industri berbasis kebutuhan DUDIKA</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan kurikulum yang mendukung program MBKM sesuai dengan standard kompetensi Industri melalui peningkatan kerjasama dengan industri dan institusi yang terkait dalam bidang Sistem Kontrol dan Intrumentasi Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan sarana dan prasarana proses belajar mengajar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan efisiensi, efektifitas tata kelola dan organisasi yang transparan serta akuntabilitas.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Membangun dan mengembangkan jiwa wirausaha dengan meningkatkan kemampuan <i>hardskill </i>dan <i>softskill</i></span></li></ol><p>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung Program Studi D4 Teknik Elektronika :</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Workshop Mekanik dan Elektronik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Digital</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mikroprosesor dan mikrokontroller</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Otomasi dan Robotika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintanance dan Repaired</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor VLSI</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika&nbsp; Industri</span></li></ul>\";s:4:\"logo\";s:25:\"D4_Teknik_Elektronika.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T08:41:08.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:44:49.000000Z\";}', 'a:8:{s:2:\"id\";i:10;s:4:\"nama\";s:14:\"Teknik Elektro\";s:4:\"kode\";s:2:\"EE\";s:4:\"logo\";s:18:\"Teknik_Elektro.jpg\";s:9:\"deskripsi\";s:3652:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-ELEKTRO-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi, Misi, Tujuan Dan Strategi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Visi</strong></span></p><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan tinggi vokasional yang unggul dibidang teknik elektro yang mampu</span><br><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">bersaing secara nasional dan internasional</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Misi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan pendidikan vokasi dibidang Teknik Elektro untuk menghasilkan&nbsp;lulusan yang bermutu, berakhlak, berjiwa wirausaha dan dapat bersaing diskala&nbsp;nasional dan Internasional.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">2. &nbsp;Mengembangkan ilmu pengetahuan dan teknologi terapan berbasis kebutuhan&nbsp;industri.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">&nbsp;3. &nbsp;Meningkatkan sistem manajemen mutu pendidikan di Jurusan Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">4. Mengimplementasikan Tridharma Perguruan Tinggi melalui pengembangan ilmu&nbsp;terapan di bidang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Teknik Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">5.Berpartisipasi aktif dalam kehidupan masyarakat Sumatera Barat di bidang Teknik&nbsp;Elektro.</span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Tujuan</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi pusat pendidikan dan pengembangan ilmu pengetahuan dan teknologi terapan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan lulusan Diploma III dan Diploma IV Teknik Elektro yang berahlak mulia, berbudi luhur, berjiwa kewirausahaan dan mempunyai kemampuan serta keterampilan di bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Mempublikasikan hasil penelitian dan karya ilmiah ditingkat nasional maupun internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Menyediakan keahlian dan bantuan teknik, serta pendidikan dan pelatihan profesional melalui penerapan ilmu pengetahuan yang relevan dengan permasalahan bidang Teknik Elektro.</span></li><li><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Memberikan penyuluhan dan pelatihan dibidang teknik elektro kepada masyarakat</span></li></ol><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\"><strong>Sasaran</strong></span></p><p><span style=\"color:hsl(0,0%,0%);font-family:Arial, Helvetica, sans-serif;\">Tercapainya pelaksanaan Tri Dharma Perguruan Tinggi oleh dosen dan mahasiswa Jurusan Teknik Elektro untuk memenuhi kebutuhan masyarakat, perkembangan ilmu pengetahuan dan teknologi yang makin cepat didukung penuh seluruh civitas akademika.</span></p>\";s:7:\"website\";s:26:\"https://elektro.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:01:39.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:14:10.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Ele