ingkat\";i:10;}s:3:\"3TC\";a:2:{s:5:\"nilai\";i:20;s:9:\"peringkat\";i:11;}s:3:\"3BI\";a:2:{s:5:\"nilai\";i:10;s:9:\"peringkat\";i:12;}s:3:\"3EL\";a:2:{s:5:\"nilai\";i:-12;s:9:\"peringkat\";i:13;}s:4:\"4RPM\";a:2:{s:5:\"nilai\";i:-14;s:9:\"peringkat\";i:14;}s:3:\"3SP\";a:2:{s:5:\"nilai\";i:-16;s:9:\"peringkat\";i:15;}s:3:\"3ME\";a:2:{s:5:\"nilai\";i:-22;s:9:\"peringkat\";i:16;}s:5:\"4TMAN\";a:2:{s:5:\"nilai\";i:-32;s:9:\"peringkat\";i:17;}s:3:\"4DP\";a:2:{s:5:\"nilai\";i:-36;s:9:\"peringkat\";i:18;}s:4:\"4UPW\";a:2:{s:5:\"nilai\";i:-36;s:9:\"peringkat\";i:19;}s:3:\"3AB\";a:2:{s:5:\"nilai\";i:-40;s:9:\"peringkat\";i:20;}s:3:\"4BI\";a:2:{s:5:\"nilai\";i:-48;s:9:\"peringkat\";i:21;}s:3:\"3AK\";a:2:{s:5:\"nilai\";i:-66;s:9:\"peringkat\";i:22;}s:3:\"4AK\";a:2:{s:5:\"nilai\";i:-68;s:9:\"peringkat\";i:23;}s:4:\"4LPI\";a:2:{s:5:\"nilai\";i:-106;s:9:\"peringkat\";i:24;}s:4:\"3TAB\";a:2:{s:5:\"nilai\";i:-112;s:9:\"peringkat\";i:25;}}', '4TRPL', 'a:9:{s:2:\"id\";i:41;s:10:\"id_jurusan\";i:14;s:4:\"kode\";s:5:\"4TRPL\";s:4:\"nama\";s:37:\"D4 Teknologi Rekayasa Perangkat Lunak\";s:10:\"akreditasi\";s:8:\"C / Baik\";s:9:\"deskripsi\";s:5689:\"<h2><span style=\"color:hsl(0, 0%, 0%);\">D4 Teknologi Rekayasa Perangkat Lunak</span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Memiliki kemampuan membangun jaringan komputer internet dan intranet dan membuat aplikasi dan mengelola sistem informasi berbasis LAN (Local Area Network) dan Internet untuk berbagai organisasi perkantoran dan bisnis. Menguasai berbagai program aplikasi (programmer)</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>DESKRIPSI PRODI</strong></span></h3><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Program studi D4 Teknologi Rekayasa Perangkat Lunak pada jurusan Teknologi Informasi memiliki latar belakang yang kuat dalam menghasilkan tenaga ahli di bidang pengembangan perangkat lunak. Di era informasi digital dan teknologi yang terus berkembang pesat, kebutuhan akan perangkat lunak berkualitas tinggi semakin meningkat. Oleh karena itu, program studi ini dirancang untuk memberikan pemahaman mendalam tentang konsep-konsep dasar teknologi rekayasa perangkat lunak, metodologi pengembangan, kebutuhan, analisis sistem desain, pengujian perangkat lunak, dan manajemen proyek perangkat lunak. Aspek-aspek latar belakang dari program studi D4 Teknologi Rekayasa Perangkat Lunak mencakup beberapa hal yang mendasari pendirian program ini.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Berikut adalah beberapa aspek kunci :</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kebutuhan Industri</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Permintaan akan profesional di bidang rekayasa perangkat lunak terus meningkat seiring dengan perkembangan teknologi informasi. Perusahaan-perusahaan membutuhkan pengembang perangkat lunak yang terampil untuk mengembangkan solusi teknologi yang inovatif dan berkualitas tinggi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kompleksitas Perangkat Lunak</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Perangkat lunak modern semakin kompleks dan terintegrasi dengan berbagai sistem. Oleh karena itu, dibutuhkan pemahaman mendalam tentang metodologi pengembangan perangkat lunak yang efektif untuk menghadapi tantangan ini.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kualitas dan Keamanan</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Kualitas perangkat lunak sangat penting untuk menghindari masalah dan kerentanan yang dapat merugikan pengguna. Program studi ini menekankan pada praktik pengembangan yang berfokus pada kualitas, pengujian, dan keamanan perangkat lunak.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Teknologi Terkini</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program ini mencakup pemahaman tentang teknologi terkini dalam industri perangkat lunak, seperti Agile, DevOps, teknologi cloud, pengembangan aplikasi mobile, dan keamanan siber. Mahasiswa diajarkan tentang tren terbaru untuk mempersiapkan mereka menghadapi tantangan masa depan.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kerja Sama Industri</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Kerja sama dengan industri membantu program studi memahami kebutuhan aktual pasar kerja. Ini juga memberikan kesempatan bagi mahasiswa untuk berinteraksi dengan praktisi industri, mengikuti magang, dan menerapkan pengetahuan mereka dalam lingkungan nyata.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengembangan Keterampilan Soft Skills</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Selain keterampilan teknis, program ini juga menekankan pengembangan keterampilan interpersonal, komunikasi, dan pemecahan masalah. Keterampilan ini penting dalam kolaborasi tim dan dalam beradaptasi dengan perubahan teknologi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengalaman Praktis</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program ini seringkali menyertakan proyek-proyek praktis dalam kurikulum, memungkinkan mahasiswa untuk mengembangkan perangkat lunak nyata dan mendapatkan pengalaman langsung dalam pengembangan perangkat lunak.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pemahaman Bisnis</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Mahasiswa juga diajarkan tentang aspek-aspek bisnis dalam pengembangan perangkat lunak, termasuk analisis kebutuhan pengguna, manajemen proyek, dan pengelolaan sumber daya.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengajaran Oleh Ahli</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program studi ini biasanya diampu oleh dosen-dosen yang ahli di bidang teknologi rekayasa perangkat lunak, memberikan wawasan mendalam kepada mahasiswa.</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Visi</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">“Menjadi program studi unggul dalam bidang teknologi rekayasa perangkat lunak yang bermartabat dan berwawasan internasional”</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Misi</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan sumber daya manusia di bidang teknologi rekayasa perangkat lunak</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan inovasi teknologi rekayasa perangkat lunak</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemograman</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Jaringan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Basis Data</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Digital</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemrograman</span></p>\";s:4:\"logo\";s:41:\"D4_Teknologi_Rekayasa_Perangkat_Lunak.png\";s:10:\"created_at\";s:27:\"2023-11-28T09:26:27.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T11:34:26.000000Z\";}', 'a:8:{s:2:\"id\";i:14;s:4:\"nama\";s:19:\"Teknologi Informasi\";s:4:\"kode\";s:2:\"TI\";s:4:\"logo\";s:23:\"Teknologi_Informasi.png\";s:9:\"deskripsi\";s:2785:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/Teknologi-Informasi-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Teknologi Informasi</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga professional tingkat ahli madya di bidang Teknologi Informasi, khususnya pengelolaan informasi berbasis komputer sehingga mampu bekerja di berbagai instansi, perkantoran organisasi dan bisnis modern.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Pada tahun 2025 menjadi institusi pendidikan vokasional terbaik tingkat nasional dibidang Teknologi Informasi, Bermartabat dan berwawasan Internasional</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi :</strong></span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan pendidikan vokasional dibidang Teknologi Informasi yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi yang berwawasan Internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelanggarakan penelitian yang inovatif dan adaptif dibidang Teknologi Informasi untuk pengembangan ilmu pengetahuan dan teknologi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menerapkan ilmu pengetahuan dan teknologi dalam rangka memecahkan masalah dan meningkatkan taraf hidup masyarakat dibidang Teknologi Informasi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menjalin kerjasama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan dan dunai usaha ditingkat Nasional dan Internasional dibidang Teknologi Informasi.</span></li></ol><p><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Teknologi Informasi memiliki empat tujuan yang merupakan turunan dari tujuan Politeknik Negeri Padang yang, sebagai berikut:</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan dibidang Teknologi Informasi yang kompeten, berdaya saing antar bangsa, bermartabat dan dan bertaqwa kepada Tuhan Yang Maha Esa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan penelitian dibidang Teknologi Informasi yang bermanfaat dan pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan karya pengabdian kepada masyarakat dibidang Teknologi Informasi yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Terwujudnya kerjasama dengan berbagai pihak, baik dalam maupun luar negeri yang saling menguntungkan</span></li></ol>\";s:7:\"website\";s:21:\"https://ti.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:20:07.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:38:06.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";a:2:{s:4:\"nama\";s:20:\"D3 Teknik Alat Berat\";s:10:\"id_jurusan\";i:6;}s:3:\"3ME\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Mesin\";s:10:\"id_jurusan\";i:6;}s:5:\"4TMAN\";a:2:{s:4:\"nama\";s:20:\"D4 Teknik Manufaktur\";s:10:\"id_jurusan\";i:6;}s:4:\"4RPM\";a:2:{s:4:\"nama\";s:31:\"D4 Rekayasa Perancangan Mekanik\";s:10:\"id_jurusan\";i:6;}s:3:\"3SP\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Sipil\";s:10:\"id_jurusan\";i:9;}s:4:\"4MRK\";a:2:{s:4:\"nama\";s:32:\"D4 Manajemen Rekayasa Konstruksi\";s:10:\"id_jurusan\";i:9;}s:4:\"4PJJ\";a:2:{s:4:\"nama\";s:33:\"D4 Perancangan Jalan Dan Jembatan\";s:10:\"id_jurusan\";i:9;}s:5:\"4TPIR\";a:2:{s:4:\"nama\";s:38:\"D4 Teknik Perencanaan Irigasi Dan Rawa\";s:10:\"id_jurusan\";i:9;}s:3:\"3EC\";a:2:{s:4:\"nama\";s:21:\"D3 Teknik Elektronika\";s:10:\"id_jurusan\";i:10;}s:3:\"3EL\";a:2:{s:4:\"nama\";s:17:\"D3 Teknik Listrik\";s:10:\"id_jurusan\";i:10;}s:3:\"3TC\";a:2:{s:4:\"nama\";s:24:\"D3 Teknik Telekomunikasi\";s:10:\"id_jurusan\";i:10;}s:3:\"4EC\";a:2:{s:4:\"nama\";s:21:\"D4 Teknik Elektronika\";s:10:\"id_jurusan\";i:10;}s:3:\"4TC\";a:2:{s:4:\"nama\";s:24:\"D4 Teknik Telekomunikasi\";s:10:\"id_jurusan\";i:10;}s:5:\"4TRIL\";a:2:{s:4:\"nama\";s:39:\"D4 Teknologi Rekayasa Instalasi Listrik\";s:1