\">• Bengkel Rainange</span></p>\";s:4:\"logo\";s:42:\"D4_Teknik_Perencanaan_Irigasi_Dan_Rawa.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T08:20:16.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T14:18:34.000000Z\";}', 'a:8:{s:2:\"id\";i:9;s:4:\"nama\";s:12:\"Teknik Sipil\";s:4:\"kode\";s:2:\"SP\";s:4:\"logo\";s:16:\"Teknik_Sipil.jpg\";s:9:\"deskripsi\";s:5031:\"<figure class=\"image\"><img style=\"aspect-ratio:960/540;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/TEKNIK-SIPIL-2023.png\" width=\"960\" height=\"540\"></figure><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi, Misi, Tujuan dan Sasaran</strong></span></h2><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>Pada tahun 2025 menjadi unit pengelola program studi vokasional teknik sipil yang bermartabat, andal,unggul dan berstandar internasionl</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\"><i>1. Mengelola Program Studi pendidikan vokasional yang inovatif , aplikatif dan adaptif untuk menghasilkan lulusan yang kompeten, berjiwa kewirausahaan dan berwawasan internasional.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>2. Melaksanakan program penelitian yang bermanfaat bagi masyarakat dan berkonstribusi pada pengembangan keilmuan terapan serta pencapaian hak atas kekayaan intelektual (HKI) dan paten.</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>3. Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat .</i></span></p><p><span style=\"color:hsl(0,0%,0%);\"><i>4. Menjalin kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan, dan dunia usaha di tingkat nasional dan internasional.</i></span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Berdasarkan visi dan misi yang telah ditetapkan, tujuan yang ingin dicapai oleh Unit Pengelola Program Studi vokasional teknik Sipil adalah :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menjadikan program studi yang unggul dilingkungannya agar lulusannya bertaqwa kepada Tuhan Yang Maha Esa, bermartabat, kompeten, dan mendapatkan pengakuan secara nasional dan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian yang bermanfaat untuk pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten untuk mendukung kemandirian bangsa</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pelayanan melalui penyediaan fasilitas, prasarana, sarana dan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memperluas dan meningkatkan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mewujudkan pengembangan Program Studi Vokasi yang relevan dengan industri jasa konstruksi yang berkualitas dan berkesinambungan</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Untuk mencapai tujuan tersebut, maka Unit Pengelola Program Studi Vokasional Teknik Sipil menetapkan 9 sasaran strategi sebagai berikut :</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya sarana dan prasarana serta fasilitas pendukung proses pembelajaran yang menekankan pada penguasaan keahlian terapan dan berjiwa kewirausahaan;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terbentuknya organ-organ penyelenggara Jurusan Teknik Sipil dan tata kelola organisasi yang tangguh, mandiri dan terpadu;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya kualitas lulusan berbasis kompetensi, daya saing dan bermartabat di tingkat nasional maupun internasional;</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya penelitian aplikatif yang bermanfaat dalam pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI) dan paten</span></li><li><span style=\"color:hsl(0,0%,0%);\">Adanya karya pengabdian kepada masyarakat yang berbasis pada teknologi terapan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatnya mutu pelayanan melalui manajemen yang efektif dan efesien bagi civitas dengan menerapkan teknologi informasi sesuai dengan Standar Nasional Pendidikan Tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Tersedianya dosen dan tenaga kependidikan yang berkualifikasi dan bersertifikasi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Ada peningkatan jaringan kerjasama dengan berbagai lembaga pemerintah/swasta di dalam dan luar negeri yang saling menguntungkan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terwujudnya program studi baru yang relevan untuk memenuhi kebutuhan industri dan masyarakat</span></li></ol>\";s:7:\"website\";s:24:\"https://sipil.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T16:56:59.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:13:38.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{