akukan negosiasi secara efektif dengan pelbagai pihak dalam usaha mengembangkan kehidupan kemasyarakatan yang lebih humanis.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Bidang Kerja :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">(Public Relation, Secretary, Receptionist, IT Operator, Telephone Operator, Tour Guide, Interpreter/ Translator, Customer Service, Travel Agent, Englisjh Course Owner and Instructor, MC, News Reader, Reporter, Journalist, Columnist, Host, Language Editor, Copy Writer, Movie Translator)</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Computer and Multimedia based English</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Language Laboratory</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Computer and Multimedia based English Teaching</span><br><span style=\"color:hsl(0, 0%, 0%);\">• English Club with Native Speakers</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Self Acces Center</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Library / Resources Centre</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Free Internet Acces (Hot Spot Areas)</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Studens Activity Centre</span></p>\";s:4:\"logo\";s:21:\"D3_Bahasa_Inggris.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T09:21:01.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T11:21:47.000000Z\";}', 'a:8:{s:2:\"id\";i:13;s:4:\"nama\";s:14:\"Bahasa Inggris\";s:4:\"kode\";s:2:\"BI\";s:4:\"logo\";s:18:\"Bahasa_Inggris.jpg\";s:9:\"deskripsi\";s:1706:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ENGLISH-DEPARTMENT-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Bahasa Inggris</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki kemampuan berfikir kritis, analitis dan memiliki rasa kepercayaan diri yang tinggi dan keterampilan berkomunikasi dalam bahasa Inggris dengan baik secara lisan dan tulisan untuk memenuhi kepentingan dunia usaha dan dunia industri, konsep, teknik dan keterampilan penerjemahan dari bahasa inggris ke bahasa indonesia dan sebaliknya,l serta keterampilan berbahasa inggris lisan dan tulisan dalm bidang komunikasi ( MC, Host, Spokesperson, News Reader, Reporter, Journalist,etc).</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">FASILITAS</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Bahasa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Multimedia</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Translation</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini TV</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini Radio</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Sitim pendidikan:</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Perkuliahn diberikan dengan metode pembelajaran Blended Learning dengan presentase 60 % praktek dan 40% teori.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Perkuliahan diampu oleh dosen tetap dari jurusan Bahasa Inggris PNP dan para praktisi dari industri.</span></p>\";s:7:\"website\";s:23:\"https://bing.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:16:21.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:57:49.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s