-nilai kearifan budaya lokal Sumatera Barat berupa sejarah dan warisan budaya Minangkabau.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">TUJUAN</span></h3><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang handal sebagai Pengelola Objek dan daya tarik wisata (DMO), Tenaga ahli di konsultan pariwisata (peneliti muda, asisten peneliti, tenaga lapangan), Manager Sales dan Marketing Pariwisata, Event Organizer, Entrepreneur di Industri Pariwisata dan Hospitaliti, dan Peneliti di Bidang Pariwisata.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Fasilitas</span></h3><p><span style=\"color:hsl(0,0%,0%);\">• Labor Ticketing</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Simulasi Bisnis</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Bahasa</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Pengetikan</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Internet</span><br><span style=\"color:hsl(0,0%,0%);\">• Bus Pariwisata</span></p>\";s:4:\"logo\";s:27:\"D4_Destinasi_Pariwisata.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T09:14:45.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T11:17:43.000000Z\";}', 'a:8:{s:2:\"id\";i:11;s:4:\"nama\";s:18:\"Administrasi Niaga\";s:4:\"kode\";s:2:\"AN\";s:4:\"logo\";s:22:\"Administrasi_Niaga.jpg\";s:9:\"deskripsi\";s:1910:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/ADMINISTRASI-NIAGA-2023a.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Administrasi Niaga</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Adminisitrasi Niaga berdiri pada tahun 1997 berdasarkan Surat Keputusan Direktorat Jenderal Pendidikan Tinggi nomor 190/Dikti/Kep/1997. Melalui Program Studi Administrasi Bisnis, jurusan Administrasi Niaga bertransformasi menjadi salah satu jurusan dengan peminat tertinggi setiap tahunnya di Politeknik Negeri Padang. Pada tahun 2008, untuk mengakomodir tuntutan kebutuhan industri perjalanan wisata di Sumatera Barat yang sangat besar maka didirikanlah Program Studi Usaha Perjalanan Wisata.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">TUJUAN</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan tenaga Ahli Madya profesional dalam bidang kesekretariatan dan administrasi perkantoran sesuai dengan kebutuhan dunia usaha dan dunia industri yang berkeahlian tinggi dalam menagani operasi perkantoran dan berwawasan konseptual yang baik untuk mengembangkan sistem perkantoran bisnis secara menyeluruh.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang dalam merancang tour, baik inbound maupun outbond, melakukan reservasi dan dokumentasi tour, melakukan pemanduan (<i>guiding</i>) wisata.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang handal sebagai Pengelola Objek dan daya tarik wisata (DMO), Tenaga ahli di konsultan pariwisata (peneliti muda, asisten peneliti, tenaga lapangan), Manager Sales dan Marketing Pariwisata, Event Organizer, Entrepreneur di Industri Pariwisata dan Hospitaliti, dan Peneliti di Bidang Pariwisata.</span></li></ol>\";s:7:\"website\";s:20:\"http://an.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:09:01.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:53:17.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";