:\"nilai\";i:16;s:9:\"peringkat\";i:11;}s:4:\"4MRK\";a:2:{s:5:\"nilai\";i:12;s:9:\"peringkat\";i:12;}s:4:\"4LPI\";a:2:{s:5:\"nilai\";i:8;s:9:\"peringkat\";i:13;}s:3:\"3TK\";a:2:{s:5:\"nilai\";i:2;s:9:\"peringkat\";i:14;}s:4:\"4UPW\";a:2:{s:5:\"nilai\";i:0;s:9:\"peringkat\";i:15;}s:3:\"3EL\";a:2:{s:5:\"nilai\";i:-8;s:9:\"peringkat\";i:16;}s:3:\"3EC\";a:2:{s:5:\"nilai\";i:-12;s:9:\"peringkat\";i:17;}s:3:\"3TC\";a:2:{s:5:\"nilai\";i:-12;s:9:\"peringkat\";i:18;}s:4:\"3TAB\";a:2:{s:5:\"nilai\";i:-16;s:9:\"peringkat\";i:19;}s:4:\"4RPM\";a:2:{s:5:\"nilai\";i:-22;s:9:\"peringkat\";i:20;}s:3:\"4EC\";a:2:{s:5:\"nilai\";i:-22;s:9:\"peringkat\";i:21;}s:3:\"4TC\";a:2:{s:5:\"nilai\";i:-22;s:9:\"peringkat\";i:22;}s:3:\"3SP\";a:2:{s:5:\"nilai\";i:-32;s:9:\"peringkat\";i:23;}s:3:\"4BI\";a:2:{s:5:\"nilai\";i:-44;s:9:\"peringkat\";i:24;}s:4:\"4PJJ\";a:2:{s:5:\"nilai\";i:-74;s:9:\"peringkat\";i:25;}}', '3AK', 'a:9:{s:2:\"id\";i:35;s:10:\"id_jurusan\";i:12;s:4:\"kode\";s:3:\"3AK\";s:4:\"nama\";s:12:\"D3 Akuntansi\";s:10:\"akreditasi\";s:10:\"A / Unggul\";s:9:\"deskripsi\";s:4291:\"<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Akuntansi (Akreditasi: Unggul)</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Program Studi DIII Akuntansi Politeknik Negeri Padang (PNP)&nbsp; didirikan pada tahun 1997 merupakan&nbsp; lembaga pendidikan tinggi negeri vokasi bidang akuntansi satu-satunya di Sumatera Barat. PS Akuntansi merupakan PS dengan jumlah peminat terbanyak di PNP sekarang ini. Hal ini terlihat dari keketatan persaingan calon mahasiswa baru antara yang diterima dengan yang mendaftar&nbsp;&nbsp; mencapai 1: 8, sehingga PS dapat menjaring calon mahasiswa baru yang lebih berkualitas. Proses pembelajaran di PS Akuntansi juga mengacu sepenuhnya pada filosofi pengajaran vokasional (Politeknik) yang lebih menekankan pada penguasaaan hardskill dan sofskill mahasiswa melalui<strong> </strong><i><strong>jam kuliah praktek (60%)</strong></i> dan <i><strong>jam kuliah teori (40%)</strong></i>. Sejalan dengan itu, kurikulum yang digunakan di PS dirancang sedemikian rupa dengan memperhatikan kebutuhan pemakai lulusan, mempertimbangkan masukan dari alumni PS serta perkembangan iptek. Hasilnya terlihat dari hasil pembelajaran (IPK) lulusan yang cukup tinggi yang berujung pada tingginya penyerapan lulusan di pasar kerja. Memanfaatkan kebutuhan akan Ahli Madya Akuntansi yang semakin tinggi di lapangan, PS Akuntansi terus berupaya memperluas aksesnya melalui kerjasama dengan pemakai lulusan.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Visi</span></h3><blockquote><p><span style=\"color:hsl(0,0%,0%);\"><i><strong>Menjadi institusi pendidikan vokasional unggulan bidang akuntansi program diploma III di Asia Tenggara.</strong></i></span></p></blockquote><h3><span style=\"color:hsl(0,0%,0%);\">Misi</span></h3><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan dan mengembangkan pendidikan vokasi bidang akuntansi untuk menghasilkan lulusan yang kompeten, berintegritas, bermutu tinggi, berwawasan internasional, berjiwa kewirausahaan dan relevan dengan kebutuhan dunia kerja dan masyarakat sehingga mampu bersaing di tingkat nasional dan asia tenggara.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengimplementasikan <i>good university governance </i>dalam pengelolaan Program Studi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian terapan serta pengembangan ilmu pengetahuan vokasi bidang akuntansi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan pengabdian kepada masyarakat dan menjalin kerjasama dengan berbagai pihak yang memberikan kontribusi dalam pengembangan pendidikan vokasi, memecahkan permasalahan dan meningkatkan taraf hidup masyarakat di bidang akuntansi.</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\">Tujuan</span></h3><ol><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang memenuhi standar kompetensi akuntansi nasional dan internasional, berwawasan internasional, profesional, unggul, dan berintegritas, serta memiliki jiwa wirausaha.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menciptakan tata kelola program studi yang efisien, efektif, transparan dan akuntabel.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian terapan dan pengembangan ilmu pengetahuan vokasi bidang akuntansi yang menjadi rujukan nasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan pengabdian masyarakat melalui pemanfaatan ilmu pengetahuan dan teknologi bidang akuntansi yang memberikan kontribusi dalam pengembangan pendidikan vokasi, memecahkan permasalahan dan meningkatkan kesejahteraan masyarakat serta terjalinnya kerjasama dengan berbagai pihak dalam rangka peningkatan kualitas pendidikan vokasi bidang akuntansi.</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\">Fasilitas</span></h3><p><span style=\"color:rgb(51,51,51);\">• Labor Komputer Akuntasi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Akuntansi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Kerja Anggaran Manufaktur</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Akuntansi Pemeriksaan</span><br><span style=\"color:rgb(51,51,51);\">• Labor Anggaran</span><br><span style=\"color:rgb(51,51,51);\">• Labor Sistem Informasi Akuntansi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Anggaran Bank Mini</span></p>\";s:4:\"logo\";s:16:\"D3_Akuntansi.jpg\";s:10:\"created_at\";s:27:\"2023-11-28T09:18:57.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T11:10:30.000000Z\";}', 'a:8:{s:2:\"id\";i:12;s:4:\"nama\";s:9:\"Akuntansi\";s:4:\"kode\";s:2:\"AK\";s:4:\"logo\";s:13:\"Akuntansi.jpg\";s:9:\"deskripsi\";s:2749:\"<figure class=\"image\"><img style=\"aspect-ratio:100%/auto;\" src=\"https://sp-ao.shortpixel.ai/client/to_webp,q_glossy,ret_img,w_960/https://www.pnp.ac.id/wp-content/uploads/2023/01/AKUNTANSI-2023.png\" width=\"100%\" height=\"auto\"></figure><h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurusan Akuntansi</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);\">Jurusan Akuntansi Politeknik Negeri Padang (PNP) berdiri sejak tahun 1997 dan merupakan satu-satunya lembaga pendidikan tinggi vokasi bidang akuntansi di Sumatera Barat yang menyelenggarakan pendidikan vokasi pada jenjang Magister Terapan (S2), Diploma IV (Terakreditasi A) dan Diploma III (Unggul).</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Proses pembelajaran di Jurusan Akuntansi sepenuhnya mengacu pada filosofi pengajaran vokasi (Politeknik) yang lebih menekankan pada penguasaan hard skill dan soft skill mahasiswa dengan komposisi jam perkuliahan praktik (60%) dan jam perkuliahan teori (40%).</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Penerapan Kurikulum Berbasis Kompetensi (KBK) dan penyusunan kurikulum disesuaikan dengan KKNI (Kerangka Kualifikasi Nasional Indonesia) sehingga kurikulum dirancang dengan mempertimbangkan kebutuhan pengguna lulusan.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Kerjasama dengan industri diwujudkan dalam bentuk MoU dengan industri pengguna lulusan seperti Kantor Akuntan Publik (KAP), BUMN, BUMD, serta instansi pemerintah dan swasta.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">TUJUAN</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menciptakan lulusan yang mampu dan terampil dalam bidang seperti: Asistant Accounting, Financial Computer System, Internal Auditor, Asistant Auditor, Asistant Analisis System, menghitung dan membuat laporan pajak,</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki keahlian dan wawasan dibidang akuntansi, audit, pajak dan keuangan secara integrasi dan komprehensif yang bisa diterapkan pada perusahaan swasta, instansi pemerintah maupun lembaga keuangan baik berskala nasional maupun internasional.</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">FASILITAS</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Komputer Akuntasi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Akuntansi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Kerja Anggaran Manufaktur</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Praktek Akuntansi Pemeriksaan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Anggaran</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Sistem Informasi Akuntansi</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Labor Anggaran Bank Mini</span></li></ol>\";s:7:\"website\";s:28:\"https://akuntansi.pnp.ac.id/\";s:10:\"created_at\";s:27:\"2023-11-27T17:12:03.000000Z\";s:10:\"updated_at\";s:27:\"2023-12-03T10:28:09.000000Z\";}', 'a:7:{i:6;a:2:{s:4:\"kode\";s:2:\"ME\";s:4:\"nama\";s:12:\"Teknik Mesin\";}i:9;a:2:{s:4:\"kode\";s:2:\"SP\";s:4:\"nama\";s:12:\"Teknik Sipil\";}i:10;a:2:{s:4:\"kode\";s:2:\"EE\";s:4:\"nama\";s:14:\"Teknik Elektro\";}i:11;a:2:{s:4:\"kode\";s:2:\"AN\";s:4:\"nama\";s:18:\"Administrasi Niaga\";}i:12;a:2:{s:4:\"kode\";s:2:\"AK\";s:4:\"nama\";s:9:\"Akuntansi\";}i:13;a:2:{s:4:\"kode\";s:2:\"BI\";s:4:\"nama\";s:14:\"Bahasa Inggris\";}i:14;a:2:{s:4:\"kode\";s:2:\"TI\";s:4:\"nama\";s:19:\"Teknologi Informasi\";}}', 'a:25:{s:4:\"3TAB\";a:2:{s:4:\"nama\";s:20:\"D3 Teknik Alat Berat\";s:10:\"id_jurusan\";i:6;}s:3:\"3ME\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Mesin\";s:10:\"id_jurusan\";i:6;}s:5:\"4TMAN\";a:2:{s:4:\"nama\";s:20:\"D4 Teknik Manufaktur\";s:10:\"id_jurusan\";i:6;}s:4:\"4RPM\";a:2:{s:4:\"nama\";s:31:\"D4 Rekayasa Perancangan Mekanik\";s:10:\"id_jurusan\";i:6;}s:3:\"3SP\";a:2:{s:4:\"nama\";s:15:\"D3 Teknik Sipil\";s:10:\"id_jurusan\";i:9;}s:4:\"4MRK\";a:2:{s:4:\"nama\";s:32:\"D4 Manajemen Rekayasa Konstruksi\";s:10:\"id_jurusan\";i:9;}s:4:\"4PJJ\";a:2:{s:4:\"nama\";s:33:\"D4 Perancangan Jalan Dan Jembatan\";s:10:\"id_jurusan\";i:9;}s:5:\"4TPIR\";a:2:{s:4:\"nama\";s:38:\"D4 Teknik Perencanaan Irigasi Dan Rawa\";s:10:\"id_jurusan\";i:9;}s:3:\"3EC\";a:2:{s:4:\"nama\";s:21:\"D3 Teknik Elektronika\";s:10:\"id_jurusan\";i:10;