(15, 6, '3TAB', 'D3 Teknik Alat Berat', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Teknik Alat Berat</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi pendidikan vokasi unggul di bidang perawatan Teknik Alat Berat pada tahun 2022</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan pendidikan tinggi vokasional yang berbasis karakter untuk menghasilkan sumber daya manusia mandiri yang berkualitas demi kemakmuran bangsa.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan pendidikan dan pelatihan bidang keahlian alat berat.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menciptakan lingkungan dan atmosfer akademik yang berkualitas dengan sistem manajemen yang profesional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan tridarma perguruan tinggi melalui pengembangan ilmu pengetahuan dan teknologi terapan.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Untuk menghasilkan lulusan yang berkualitas dan profesional bidang Teknik Alat Berat yang kompetitif di pasar kerja dengan kompetensi teknisi setingkat level “Technician”</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memiliki dasar-dasar ilmu keteknikan dan alat berat serta mampu bekerja dengan mengunakan <i>workshop tools</i> dan <i>workshop equipment</i> dengan benar dan aman sesuai dengan <i>service literature</i></span></li><li><span style=\"color:hsl(0,0%,0%);\">Mampu membongkar pasang dan mengidentifikasi komponen-komponen serta alat berat yang meliputi engine, sistem hidraulik, sistem elektrik, power train dan <i>undercarriage</i></span></li><li><span style=\"color:hsl(0,0%,0%);\">Mampu melakukan pengetesan dan penyetelan pada komponen-komponen alat berat serta memiliki kemampuan dasar dalam <i>problem solving</i>, troubleshooting dan analisa kegagalan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Memiliki karakter produktif yang berakhlak mulia</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mempunyai kemampuan mendorong dirinya berprestasi dan mengembangkan karir lebih lanjut ke jenjang yang lebih tinggi.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran dan Strategi Pencapaian</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan atmosfir akademis dengan organisasi sistem kependidikan yang baik dan layanan manajemen yang berkualitas.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan kualitas kurikulum melalui Rencana Pembelajaran Semester (RPS) &nbsp;dan kontrak Pembelajaran yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi di bidang alat berat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terbentuknya kelompok bidang keahlian dan mengajar (<i>team teaching)</i> untuk melakukan perubahan pengembangan materi ajar yang tertuang dalam RPS dan Kontrak Pembelajaran yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi alat berat</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan pengetahuan dan kemampuan kompetensi lulusan dan daya serap pasar kerja</span></li><li><span style=\"color:hsl(0,0%,0%);\">Peningkatan hubungan kerjasama dengan industri dan instansi terkait di bidang teknik alat berat</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\">Fasilitas Pendukung</span></h2><ol><li><span style=\"color:rgb(51,51,51);\">Excavator</span></li><li><span style=\"color:rgb(51,51,51);\">Buldozer</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Pengujian Bahan</span></li><li><span style=\"color:rgb(51,51,51);\">Workshop Produksi</span></li><li><span style=\"color:rgb(51,51,51);\">Workshop Perawatan &amp; Perbaikan</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium CNC</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Komputer</span></li><li><span style=\"color:rgb(51,51,51);\">Studio Gambar dan Perancangan</span></li><li><span style=\"color:rgb(51,51,51);\">Laboratorium Refrigerasi &amp; Pengkondisian Udara</span></li></ol>', 'D3_Teknik_Alat_Berat.jpg', '2023-11-28 00:15:10', '2023-12-03 03:39:14'),
(16, 6, '3ME', 'D3 Teknik Mesin', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Teknik Mesin</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi pendidikan vokasi yang unggul di bidang Teknik Mesin</span><br><span style=\"color:hsl(0,0%,0%);\">yang bermartabat, profesional, memiliki integritas dan berdaya saing</span><br><span style=\"color:hsl(0,0%,0%);\">internasional.</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan kegiatan pendidikan vokasi yang kreatif dan inovatif</span><br><span style=\"color:hsl(0,0%,0%);\">guna menghasilkan lulusan Teknik Mesin di bidang produksi</span><br><span style=\"color:hsl(0,0%,0%);\">pemesinan, perawatan mesin-mesin dan otomasi yang mampu</span><br><span style=\"color:hsl(0,0%,0%);\">bersaing di tingkat nasional dan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan kegiatan penelitian yang dapat memberikan</span><br><span style=\"color:hsl(0,0%,0%);\">sumbangan terhadap perkembangan ilmu pengetahuan dan teknologi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan kegiatan pengabdian kepada masyarakat guna</span><br><span style=\"color:hsl(0,0%,0%);\">mengimplementasikan ilmu teknik mesin.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menjalin kerjasama dengan industri, lembaga dan institusi terkait untuk</span><br><span style=\"color:hsl(0,0%,0%);\">memperluas jaringan dan informasi teknologi terbaru.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melaksanakan tata kelola dan pelayanan Program Studi yang</span><br><span style=\"color:hsl(0,0%,0%);\">berkualitas untuk menunjang Tridharma Perguruan Tinggi melalui</span><br><span style=\"color:hsl(0,0%,0%);\">implementasi sistem penjaminan mutu.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan sumber daya manusia yang berakhlak baik serta mampu</span><br><span style=\"color:hsl(0,0%,0%);\">mengembangkan diri secara berkesinambungan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan D3 Teknik Mesin di bidang produksi pemesinan,</span><br><span style=\"color:hsl(0,0%,0%);\">perawatan mesin-mesin dan otomasi yang kompeten mengacu kepada</span><br><span style=\"color:hsl(0,0%,0%);\">standar KKNI, dan mampu bersaing di tingkat nasional dan</span><br><span style=\"color:hsl(0,0%,0%);\">internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Berperan aktif dalam mengembangkan pengetahuan teknik mesin</span><br><span style=\"color:hsl(0,0%,0%);\">melalui penelitian dan pengabdian kepada masyarakat yang berdaya</span><br><span style=\"color:hsl(0,0%,0%);\">guna yang diintegrasikan dengan pendidikan.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan dan memperluas kerjasama dengan industri, lembaga</span><br><span style=\"color:hsl(0,0%,0%);\">dan institusi terkait untuk memperluas jaringan dan informasi teknologi</span><br><span style=\"color:hsl(0,0%,0%);\">guna menunjang Tridharma Perguruan Tinggi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan kualitas tata kelola Program Studi untuk menunjang Tridharma Perguruan Tinggi melalui implementasi sistem penjaminan mutu.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\">Fasilitas Pendukung</span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor CNC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pneumatik Hidrolik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengujian Bahan &amp; Metrologi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mekanika Fluida &amp; Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Las</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Bubut</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Miling</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Grinding/gerinda</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Sheet Metal</span></li></ol>', 'D3_Teknik_Mesin.jpg', '2023-11-28 00:17:43', '2023-12-03 03:39:44'),
(17, 6, '4TMAN', 'D4 Teknik Manufaktur', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D4 Teknik Manufaktur</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi Pusat Unggulan Teknologi Manufaktur</span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Misi</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan kemampuan Sumber Daya Manusia dalam bidang Teknologi Manufaktur</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan Inovasi Teknologi Manufaktur</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Memperkuat kompetensi Sumber Daya Manusia Program Studi Teknik Manufaktur.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan tenaga kerja yang mempunyai keahlian dalam bidang Teknik Manufaktur.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan Ilmu Pengetahuan dan Teknologi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengujian Bahan dan Metrologi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Fluida dan Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Grinding/Gerinda</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Milling</span></li></ol>', 'D4_Teknik_Manufaktur.jpg', '2023-11-28 00:20:59', '2023-12-03 03:40:15'),
(18, 6, '4RPM', 'D4 Rekayasa Perancangan Mekanik', '- / Proses Akreditasi', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D4 Rekayasa Perancangan Mekanik</strong></span></h2><h2><span style=\"color:hsl(0,0%,0%);\"><strong>VISI</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi pelopor dan unggul dalam bidang perancangan mesin yang dibekali dengan tindakan <i>maintenance and repair of industrial machinery dan softskill.</i></span></p><h2><span style=\"color:hsl(0,0%,0%);\"><strong>MISI</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan pendidikan untuk mempersiapkan lulusan yang menguasai konsep perancangan komponen mesin dengan memperhatikan spesifikasi, konsep rancangan, optimasi, <i>ergonomic, </i>dokumentasi, <i>prototype, </i>dan uji coba yang berdaya saing global.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melakukan penelitian yang sebagai upaya pemecahan permasalahan dalam bidang vokasi dan masyarakat yang berkaitan dengan bidang perancangan mesin untuk menunjang pembangunan nasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Melakukan upaya untuk memberikan layanan kepada masyarakat, lembaga perusahaan berskala kecil, menengah dan besar dalam bidang perancangan mesin</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\"><strong>TUJUAN</strong></span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang memiliki daya saing tinggi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan sumber daya yang memiliki jiwa yang nasionalis, profesional, berjiwa <i>entrepreneur </i>dan berwawasan internasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan karya cipta yan sesuai kebutuhan industri dan masyarakat nasional dan internasional</span></li><li><span style=\"color:hsl(0,0%,0%);\">Terwujudnya konseo <i>link and match </i>melalui kerjasama dengan industri, masyarakat dan pemerintah.</span></li></ol><h2><span style=\"color:hsl(0,0%,0%);\">FASILITAS PENDUKUNG</span></h2><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor CNC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pneumatik Hidrolik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintenance</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Produksi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengujian Bahan &amp; Metrologi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mekanika Fluida &amp; Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel las</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel bubut</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel miling</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel grinding/gerinda</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel sheet Metal</span></li></ol>', 'D4_Rekayasa_Perancangan_Mekanik.jpg', '2023-11-28 00:23:05', '2023-12-03 03:40:50'),
(19, 9, '3SP', 'D3 Teknik Sipil', 'A / Unggul', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D3 Teknik Sipil (Akreditasi A)</strong></span></h2><h3><span style=\"color:hsl(0,0%,0%);\"><strong>a. Konsentrasi Konstruksi Sipil</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitannya dengan masalah perencanaan struktur, pelaksanaan dan pengawasan bangunan gedung.</span><br><span style=\"color:hsl(0,0%,0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitanya dengan masalah perencanaan, pembangunan, perlengkapan, perawatan dan perbaikan bangunan sipil non gedung seperti jalan raya, jembatan, dll.</span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>b. Konsentrasi Konstruksi Bangunan Gedung</strong></span></h3><p><span style=\"color:hsl(0,0%,0%);\">Memusatkan keahlian pada pekerjaan sipil dalam segala kaitannya dengan masalah perencanaan, pembangunan, perlengkapan, bangunan</span></p><h3><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung</strong></span></h3><ol><li><span style=\"color:hsl(0,0%,0%);\">Labor Material</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Hidrolika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mekanika Tanah</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Struktur</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Ilmu Ukur Tanah</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Kayu</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Baja</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Plumbing</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Beton</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Tepat guna</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Acuan Perancah</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Drainage</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Batu</span></li></ol>', 'D3_Teknik_Sipil.jpg', '2023-11-28 01:10:42', '2023-12-03 03:41:18'),
(20, 9, '4MRK', 'D4 Manajemen Rekayasa Konstruksi', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D4 Manajemen Rekayasa Konstruksi (Akreditasi B)</strong></span></h2><p>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan tenaga profesional di bidang manajerial khususnya pada proyek konstruksi dan mampu menyusun tahapan-tahapan perwujudan proyek konstruksi, yang dimulai dari tahap penyusunan ide, studi kelayakan, perencanaan/perancangan, hingga tahap pelaksanaan (termasuk pengawasan pelaksanaannya) serta penggunaan dari suatu proyek konstruksi. Melahirkan tenaga manajemen rekayasa konstruksi yang profesional, yang mampu mengidentifikasi, menganalisis, pengawasan, dan pengendalian terhadap risiko dari suatu pengambilan keputusan pada proyek konstruksi serta melahirkan tenaga manajemen rekayasa konstruksi yang mampu melakukan pengawasan dan pengendalian serta memberikan jaminan mutu (Quality Assurance) terhadap mutu pekerjaan suatu proyek konstruksi.</span></p><p><br><span style=\"color:hsl(0,0%,0%);\">Fasilitas Pendukung :</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Material</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Stuktur</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Tepat Guna</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Beton</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Drainage</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Batu</span></p>', 'D4_Manajemen_Rekayasa_Konstruksi.jpg', '2023-11-28 01:15:56', '2023-12-03 03:41:52'),
(21, 9, '4PJJ', 'D4 Perancangan Jalan Dan Jembatan', 'B / Baik Sekali', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Program D4 Perancangan Jalan dan Jembatan (Akreditasi B)</strong></span><br>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan tenaga kerja profesional di lapangan yang dititik-beratkan pada Perancangan Jalan dan Jembatan. Agar terciptanya tenaga kerja profesional yang mampu merencanakan serta menghitung anggaran biaya proyek-proyek dalam skala besar sekaligus menganalisis dan memilih material yang baik untuk bangunan jalan dan jembatan yang sesuai dengan tuntutan dunia kerja. Serta menciptakan atmosfir penelitian yang berkaitan dengan studi kasus dalam bidang kegagalan dan kerusakan konstruksi jalan dan jembatan guna pengembangan ilmu</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung :</strong></span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Material</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Stuktur</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Tepat Guna</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Beton</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Drainage</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Batu</span></p>', 'D4_Perancangan_Jalan_Dan_Jembatan.jpg', '2023-11-28 01:18:12', '2023-12-03 03:42:18'),
(22, 9, '4TPIR', 'D4 Teknik Perencanaan Irigasi Dan Rawa', 'A / Unggul', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>D4 Teknik Perencanaan Irigasi dan Rawa (Akreditasi UNGGUL)</strong></span>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\">Merupakan program lanjutan dari lulusan Diploma III dari program studi Teknik Sipil dan D.III yang Relevan. Program studi ini menghasilkan lulusan yang terampil dan handal dalam bidang perencanaan dan pelaksanaan bangunan irigasi dan rawa.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung :</strong></span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Material</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Hidrolika</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Mekanika Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Struktur</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Ilmu Ukur Tanah</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor komputer</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Tepat guna</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Acuan Perancah</span><br><span style=\"color:hsl(0,0%,0%);\">• Bengkel Rainange</span></p>', 'D4_Teknik_Perencanaan_Irigasi_Dan_Rawa.jpg', '2023-11-28 01:20:16', '2023-12-03 07:18:34'),
(23, 10, '3EC', 'D3 Teknik Elektronika', 'B / Baik Sekali', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D.3 Teknik Elektronika</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Menitik beratkan dalam bidang elektronika industri, meliputi perancangan rangkaian elektronika industri, menganalisis untuk perbaikan dan perawatan control serta mengaplikasikan komputer dan mikrocontroller untuk industri.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Pada tahun 2025 menjadi lembaga pendidikan terbaik di Indonesia dalam bidang ilmu elektronika dan berjiwa wirausaha</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">1.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasional melalui peningkatan penelitian dalam bidang elektronika &nbsp;dan pengabdian masyarakat untuk menghasilkan lulusan yang berkualitas.</span></p><p><span style=\"color:hsl(0,0%,0%);\">2.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasional melalui peningkatan system manajemen dan kerjasama dengan industri dan institusi yang terkait dalam bidang elektronika</span></p><p><span style=\"color:hsl(0,0%,0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan jiwa wirausaha dan produktifitas sumber daya manusia&nbsp; dibidang elektronika dengan meningkatkan kemampuan hardskill dan softskill</span></p><p><span style=\"color:hsl(0,0%,0%);\">4.&nbsp;&nbsp;&nbsp; Meningkatkan efisiensi, efektifitas tata kelola dan organisasi yang transparan serta akuntabilitas</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">1.&nbsp;&nbsp; Menghasilkan lulusan tenaga&nbsp; ahli madya yang professional,cerdas dan bermartabat.</span></p><p><span style=\"color:hsl(0,0%,0%);\">2.&nbsp;&nbsp; Menjadikan PSTE sebagai salah satu pusat pendidikan untuk meningkatkan sumber daya manusia dalam bidang elektronika dan berkarakter wirausaha.</span></p><p><span style=\"color:hsl(0,0%,0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan IPTEK dalam bidang elektronika terapan yang ramah lingkungan</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Elektronika:</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mikroprosesor</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Sistem Kontrol</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Analog &amp; Digital</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elekttronika Dasar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor M &amp; R Elektronika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Mekanik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Elektronika Dasar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika Industri</span></li></ul>', 'D3_Teknik_Elektronika.jpg', '2023-11-28 01:26:59', '2023-12-03 03:43:18'),
(24, 10, '3EL', 'D3 Teknik Listrik', 'B / Baik Sekali', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D.3 Teknik Listrik</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Berorientasi dalam bidang penerapan tentang instalasi penerangan dan tenaga, teknologi pembangkit. Sistem distribusi listrik, perawatan/ perbaikan mesin – mesin industri serta perancangan dan pengembangan teknik instrumentasi dan kontrol industri.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Menjadi pusat pendidikan, pelatihan dan pengembangan ilmu terapan bidang ketenagalistrikan yang terkemuka di wilayah Indonesia bagian Barat pada tahun 2014.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">&nbsp; &nbsp; &nbsp; 1. Meningkatkan&nbsp; sistem manajemen mutu pendidikan di&nbsp; PSTL.</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikkan yang mampu bersaing dan menciptakan lapangan pekerjaan sendiri.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan hubungan kerjasama dengan industri dan institusi terkait.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan vokasional di bidang ketenagalistrikan yang cerdas, berdayasaing tinggi, mandiri dan bermartabat dengan meningkatkan sistem manajemen mutu pendidikan di PSTL, mengembangkan ilmu terapan dibidang ketenagalistrikan yang bermanfaat bagi masyarakat dan meningkatkan kerjasama dengan industri dan institusi terkait.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Listrik :</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Instalasi Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor PLTMH</span></li></ul>', 'D3_Teknik_Listrik.jpg', '2023-11-28 01:35:07', '2023-12-03 03:43:56'),
(25, 10, '3TC', 'D3 Teknik Telekomunikasi', 'B / Baik Sekali', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D.3 Teknik Telekomunikasi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Berorientasi dalam bidang telekomunikasi kawat dan radio khususnya merancang sistem komunikasi dengan tranmisi udara (wireless) dan transmisi kawat (on wire), membuat prototype, memasang jaringan telekomunikasi, merawat dan memperbaiki serta mendiagnosis kerusakan peralatan telekomunikasi multimedia.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Pada Tahun 2025 menjadi pusat pendidikan vokasional yang terbaik dalam bidang telekomunikasi di Indonesia</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi&nbsp;</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">1.&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasi dibidang&nbsp; Teknik Telekomunikasi untuk menghasilkan lulusan yang berkarakter dan mampu berkompetisi ditingkat nasional</span></p><p><span style=\"color:hsl(0,0%,0%);\">2.&nbsp;&nbsp;&nbsp; Menyelenggarakan sistem manajemen mutu pendidikan berbasis kinerja</span></p><p><span style=\"color:hsl(0,0%,0%);\">3.&nbsp;&nbsp;&nbsp; Mengembangkan ilmu pengetahuan dan teknologi terapan bidang Telekomunikasi sesuai dengan kebutuhan industri.</span></p><p><span style=\"color:hsl(0,0%,0%);\">4.&nbsp;&nbsp;&nbsp; Meningkatkan hubungan kerjasama dengan masyarakat,&nbsp; institusi dan industri yang terkait dalam bidang telekomunikasi.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi&nbsp;</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">1.&nbsp;&nbsp;&nbsp; Menghasilkan lulusan yang&nbsp; vokasional, berkarakter dan kompeten dibidang sistem Telekomunikasi dan jaringan Telekomunikasi&nbsp; multimedia.</span></p><p><span style=\"color:hsl(0,0%,0%);\">2.&nbsp;&nbsp;&nbsp; Mewujudkan suasana akademis guna menghasilkan lulusan berintegritas, berkualitas dan kompeten, serta mampu mengembangkan IPTEK dan berkompetisi pada era globalisasi.</span></p><p><span style=\"color:hsl(0,0%,0%);\">3.&nbsp;&nbsp;&nbsp; Memiliki staf pengajar yang berintegritas dan kompeten di bidang pendidikan, penelitian dan pengabdian kepada masyarakat ditingkat nasional maupun regional.</span></p><p><span style=\"color:hsl(0,0%,0%);\">4.&nbsp;&nbsp;&nbsp; Menyediakan sarana dan prasarana untuk menunjang proses belajar mengajar.</span></p><p><span style=\"color:hsl(0,0%,0%);\">5.&nbsp;&nbsp;&nbsp; Memiliki sistem pengelolaan administrasi, keuangan dan informasi secara terintegrasi, akuntabel dan akurat.</span></p><p><span style=\"color:hsl(0,0%,0%);\">6.&nbsp;&nbsp;&nbsp; Menyelenggarakan program pendidikan yang relevan dengan perkembangan teknologi terkini.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung Program Studi D3 Teknik Telekomunikasi :</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Labor Antena</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Jaringan</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mekanik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mikroprosesor</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Pengolahan Sinyal</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Dasar Telekomunikasi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Rangkaian Elektronika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komunikasi Bergerak</span></li></ul>', 'D3_Teknik_Telekomunikasi.jpg', '2023-11-28 01:38:43', '2023-12-03 03:44:26'),
(26, 10, '4EC', 'D4 Teknik Elektronika', 'A / Unggul', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Pada tahun 2039 Program Studi Sarjana Saint Terapan Teknik Elektronika (PSSTTE) &nbsp;menjadi lembaga pendidikan vokasional yang unggul dibidang Sistem Kontrol dan Instrumentasi industry</span></p><p>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi Keilmuan Program Studi Sarjana Terapan Teknik Elektronika (PSSTTE)</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan vokasional melalui pengembangan tenaga pendidik dan kependidikan sesuai dengan perkembangan ilmu pengetahuan dan teknologi dibidang teknik elektro khususnya bidang Sistem Kontrol dan Intrumentasi Industri</span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan kualitas dan kuantitas penelitian dan pengabdian masyarakat dalam bidang ilmu pengetahuan dan teknologi bidang Sistem Kontrol dan Intrumentasi Industri berbasis kebutuhan DUDIKA</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan kurikulum yang mendukung program MBKM sesuai dengan standard kompetensi Industri melalui peningkatan kerjasama dengan industri dan institusi yang terkait dalam bidang Sistem Kontrol dan Intrumentasi Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengembangkan sarana dan prasarana proses belajar mengajar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Meningkatkan efisiensi, efektifitas tata kelola dan organisasi yang transparan serta akuntabilitas.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Membangun dan mengembangkan jiwa wirausaha dengan meningkatkan kemampuan <i>hardskill </i>dan <i>softskill</i></span></li></ol><p>&nbsp;</p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Fasilitas Pendukung Program Studi D4 Teknik Elektronika :</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Workshop Mekanik dan Elektronik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Digital</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Mikroprosesor dan mikrokontroller</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Otomasi dan Robotika</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Maintanance dan Repaired</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi Industri</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor VLSI</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika&nbsp; Industri</span></li></ul>', 'D4_Teknik_Elektronika.jpg', '2023-11-28 01:41:08', '2023-12-03 03:44:49'),
(27, 10, '4TC', 'D4 Teknik Telekomunikasi', 'A / Unggul', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Menjadi Pusat Pendidikan Tinggi Vokasi Bidang Telekomunikasi yang Unggul Dalam Bidang Teknologi Jaringan Seluler dan Internet of Things (IoT).</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi</strong></span></p><ol><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan proses pendidikan vokasi dibidang telekomunikasi untuk menghasilkan lulusan profesional di bidang teknologi jaringan seluler dan internet of things (IoT).</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Melaksanakan penelitian dan pengabdian kepada masyarakat (PkM) yang merupakan terapan dalam bidang telekomunikasi.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Mengembangkan ilmu pengetahuan dan teknologi terapan bidang telekomunikasi sesuai dengan kebutuhan industri.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><ol><li><span style=\"color:hsl(0,0%,0%);\">Menjadi pusat pendidikan vokasi dalam pengembangan iptek terapan dibidang teknologi jaringan seluler dan Internet of Things (IoT).</span><br><span style=\"color:hsl(0,0%,0%);\">2.&nbsp; Mengahasilkan lulusan Sarjana Terapan (Diploma 4) yang profesional dibidang jaringan telekomunikasi seluler dan IoT.</span><br><span style=\"color:hsl(0,0%,0%);\">3. Menghasilkan penelitian dan PkM serta luarannya ditingkat nasional dan internasional.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran program studi</strong></span></p><p><span style=\"color:hsl(0,0%,0%);\">Tercapainya pelaksanaan tri dharma Perguruan Tinggi oleh sivitas akademika Program Studi Sarjana Terapan Teknik Telekomunikasi yang dapat diterapkan pada masyarakat sesuai dengan perkembangan iptek.</span></p>', 'D4_Teknik_Telekomunikasi.jpg', '2023-11-28 01:42:52', '2023-12-03 03:45:19'),
(28, 10, '4TRIL', 'D4 Teknologi Rekayasa Instalasi Listrik', 'C / Baik', '<p><span style=\"color:hsl(0,0%,0%);\"><strong>Visi program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Menghasilkan Tenaga Ahli Vokasi dibidang Teknologi Rekayasa Instalasi Listrik terbaik di Wilayah Indonesia Bagian Barat pada tahun 2026.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Misi program studi</strong></span></p><ol><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Meningkatkan mutu pendidikan sesuai kompetensi Teknologi Rekayasa Instalasi Listrik dalam rangka mewujudkan Visi.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Mengembangkan ilmu terapan di bidang Teknologi Rekayasa Instalasi Listrik sesuai bidang kompetensi yang dibutuhkan.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Menjalin hubungan kerjasama dengan industri dan institusi tekait dalam rangka <i><strong>link and match </strong></i>sistem pembelajaran dan sarana praktek industri.</span></li><li style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Meningkatkan Kompetensi Mutu Pendidikan Vokasi dibidang Teknologi Rekayasa Instalasi Listrik didalam mewujudkan dunia kerja mandiri.</span></li></ol><p><span style=\"color:hsl(0,0%,0%);\"><strong>Tujuan program studi</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Tujuan Program Studi D IV Teknologi Rekayasa Instalasi Listrik Politeknik Negeri Padang adalah menghasilkan lulusan vokasional didalam mengembangkan keahlian dibidang Teknologi&nbsp; Rekayasa Instalasi Listrik yang cerdas, bermartabat, kompetitif, mandiri yang berjiwa kewirausahaan.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Sasaran</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0,0%,0%);\">Sasaran &nbsp;pencapaian yang dilaksanakan saat ini, yakni memperkuat program studi dalam&nbsp; &nbsp;mengelola&nbsp; sistem&nbsp; &nbsp;pendidikan&nbsp; &nbsp;vokasional,&nbsp; &nbsp;sehingga&nbsp; &nbsp;menjadi&nbsp; &nbsp;pusat pengembangan tenaga kerja yang kompeten dibidangnya.</span></p><p><span style=\"color:hsl(0,0%,0%);\"><strong>Program Studi D.4 Teknologi Rekayasa Instalasi Listrik</strong></span></p><ul><li><span style=\"color:hsl(0,0%,0%);\">Labor PLC</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Listrik Dasar</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Elektronika Daya</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Rancangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Jaringan Tegangan Listrik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Instrumentasi &amp; Sistem Kendali</span></li><li><span style=\"color:hsl(0,0%,0%);\">Labor Komputer</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Kerja Mekanik</span></li><li><span style=\"color:hsl(0,0%,0%);\">Bengkel Instalasi Listrik</span></li></ul>', 'D4_Teknologi_Rekayasa_Instalasi_Listrik.jpg', '2023-11-28 01:47:25', '2023-12-03 03:45:46'),
(29, 11, '3AB', 'D3 Administrasi Bisnis', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\"><strong>D3 Administrasi Bisnis (Akreditasi B)</strong></span></h2><p><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menghasilkan tenaga Ahli Madya profesional dalam bidang kesekretariatan dan administrasi perkantoran sesuai dengan kebutuhan dunia usaha dan dunia industri yang berkeahlian tinggi dalam menagani operasi perkantoran dan berwawasan konseptual yang baik untuk mengembangkan sistem perkantoran bisnis secara menyeluruh.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Visi :&nbsp;</span></h3><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Menjadi Program Studi Administrasi Bisnis unggul, bermartabat, dan berwawasan internasional.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">Misi:</span></h3><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">1. Menyelenggarakan&nbsp;pendidikan vokasional yang&nbsp;sesuai dengan perkembangan ilmu pengetahuan dan teknologi&nbsp;yang&nbsp;&nbsp;</span><br><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">berwawasan internasional;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">2. Menyelenggarakan penelitian&nbsp;yang&nbsp;inovatif dan&nbsp;adaptif untuk pengembangan ilmu pengetahuan dan teknologi;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">3. Menerapkan ilmu pengetahuan dan teknologi dalam rangka memecahkan masalah dan meningkatkan taraf hidup masyarakat;</span></p><p><span style=\"color:hsl(0, 0%, 0%);font-family:Arial, Helvetica, sans-serif;\">4. Menjalin kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan, dan dunia usaha ditingkat nasional dan Internasional.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Fasilitas</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Labor Perkantoran</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Pengetikan Manual</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Pengetikan Elektric</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Simulasi Bisnis</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Komputer</span></p>', 'D3_Administrasi_Bisnis.jpg', '2023-11-28 02:03:23', '2023-12-03 04:18:55'),
(32, 11, '4DP', 'D4 Destinasi Pariwisata', '- / Proses Akreditasi', '<h2><span style=\"color:hsl(0,0%,0%);\">D4 Destinasi Pariwisata</span></h2><p><span style=\"color:hsl(0,0%,0%);\">Program Studi Destinasi Pariwisata hadir dan menyesuaikan dengan arah kebijakan Kementerian Pariwisata dan Ekonomi Kreatif yang menitikberatkan kepada pengembangan destinasi pariwisata berkualitas berdasarkan prioritas, penerapan Destinasi Wisata yang Berkelanjutan, Diversivikasi Produk Pariwisata, Meningkatkan kuantitas dan kualitas SDM Kepariwisataan dan Ekonomi Kreatif, Meningkatkan daya saing destinasi dan industri pariwisata nasional, pengembangan pariwisata <i>niche market</i> (pasar yang fokus terhadap suatu jenis layanan wisata tertentu yang lebih spesifik tidak terbatas pada <i>mass market</i>).</span></p><p><span style=\"color:hsl(0,0%,0%);\">Program Studi D4 Destinasi Pariwisata memiliki keunggulan berupa program <i>Community Development on Tourism</i> yang berfokus kepada pengembangan destinasi yang berbasis kearifan budaya lokal Minangkabau. Program Studi ini lebih menitik beratkan kepada bagaimana membangun komunitas masyarakat di bidang pariwisata yang mengangkat kearifan budaya lokal sebagai ujung tombak dalam mengembangkan pariwisata dengan menginternalisasi nilai-nilai kearifan budaya lokal Sumatera Barat berupa sejarah dan warisan budaya Minangkabau.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">TUJUAN</span></h3><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang handal sebagai Pengelola Objek dan daya tarik wisata (DMO), Tenaga ahli di konsultan pariwisata (peneliti muda, asisten peneliti, tenaga lapangan), Manager Sales dan Marketing Pariwisata, Event Organizer, Entrepreneur di Industri Pariwisata dan Hospitaliti, dan Peneliti di Bidang Pariwisata.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Fasilitas</span></h3><p><span style=\"color:hsl(0,0%,0%);\">• Labor Ticketing</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Simulasi Bisnis</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Bahasa</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Pengetikan</span><br><span style=\"color:hsl(0,0%,0%);\">• Labor Internet</span><br><span style=\"color:hsl(0,0%,0%);\">• Bus Pariwisata</span></p>', 'D4_Destinasi_Pariwisata.jpg', '2023-11-28 02:14:45', '2023-12-03 04:17:43'),
(33, 11, '4LPI', 'D4 Logistik Perdagangan Internasional', '- / Proses Akreditasi', '<h2><span style=\"color:hsl(0, 0%, 0%);\">D4 Logistik Perdagangan Internasional</span></h2><ul><li><span style=\"color:hsl(0, 0%, 0%);\">Mengelola (merencanakan, mengorganisasi, memimpin, dan mengendalikan) kegiatan logistik dan rantai pasok termasuk pengadaan, penyimpanan, persediaan, dan pengiriman dengan mematuhi peraturan dan prosedur mutu yang berlaku dan memperhatikan aspek keselamatan kerja dan lingkungan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menggunakan teknologi dalam mengelola logistik dan rantai pasok serta tetap relevan dengan perkembangan terbaru</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan, mengevaluasi, dan melaksanakan prosedur operasional dan strategi perusahaan angkutan dan logistik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Merencanakan keuangan, anggaran, dan pembayaran logistik perdagangan internasional</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menerapkan prinsip ekonomi, manajemen, dan bisnis untuk untuk mengelola sumber daya manusia di bidang logistik</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan, mengevaluasi, dan melaksanakan prosedur operasional dan strategi pemasaran perusahaan</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan, mengevaluasi, dan menerapkan sistem manajemen keselamatan, kesehatan kerja, dan lingkungan (SMK3L)</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Merencanakan, melaksanakan, dan mengevaluasi sistem logistik proyek sesuai prinsip-prinsip manajemen proyek</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Merancang, menjalankan, dan mengevaluasi usaha/bisnis serta membuat proposal bisnis khususnya dalam platform perdagangan elektronik (e-commerce)</span></li></ul><h3><span style=\"color:hsl(0, 0%, 0%);\">Fasilitas</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Labor Ticketing</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Simulasi Bisnis</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Bahasa</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Pengetikan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Internet</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bus Pariwisata</span></p>', 'D4_Logistik_Perdagangan_Internasional.jpg', '2023-11-28 02:16:21', '2023-12-03 04:16:22'),
(34, 11, '4UPW', 'D4 Usaha Perjalanan Wisata', '- / Proses Akreditasi', '<h2><span style=\"color:hsl(0,0%,0%);\">D4 Usaha Perjalanan Wisata</span></h2><p><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang dalam merancang tour, baik inbound maupun outbond, melakukan reservasi dan dokumentasi tour, melakukan pemanduan (<i>guiding</i>) wisata</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Visi :&nbsp;</span></h3><p><span style=\"color:hsl(0,0%,0%);\">Menjadi program studi vokasi yang unggul dalam bidang DIV Usaha Perjalanan Wisata, berkarakter kearifan lokal, bermartabat, berwawasan hospitaliti dan kepariwisataan global di&nbsp;Asia Tenggara pada tahun 2025.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Misi :&nbsp;</span></h3><p><span style=\"color:hsl(0,0%,0%);\">1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pendidikan vokasional bidang Usaha Perjalanan Wisata yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi yang berwawasan hospitaliti dan kepariwisataan global serta berkarakter kearifan lokal;</span></p><p><span style=\"color:hsl(0,0%,0%);\">2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan penelitian terapan yang inovatif dan adaptif dalam bidang kepariwisataan yang berkontribusi terhadap industri, pemerintah dan masyarakat;</span></p><p><span style=\"color:hsl(0,0%,0%);\">3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menyelenggarakan pengabdian kepada masyarakat dibidang kepariwisataan guna mendorong pertumbuhan ekonomi kreatif serta dapat melestarikan kearifan lokal;</span></p><p><span style=\"color:hsl(0,0%,0%);\">4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menjalin kerja sama yang produktif dan berkelanjutan dengan stakeholder kepariwisataan ditingkat nasional dan internasional.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Fasilitas</span></h3><p><span style=\"color:rgb(51,51,51);\">• Labor Ticketing</span><br><span style=\"color:rgb(51,51,51);\">• Labor Simulasi Bisnis</span><br><span style=\"color:rgb(51,51,51);\">• Labor Komputer</span><br><span style=\"color:rgb(51,51,51);\">• Labor Bahasa</span><br><span style=\"color:rgb(51,51,51);\">• Labor Pengetikan</span><br><span style=\"color:rgb(51,51,51);\">• Labor Internet</span><br><span style=\"color:rgb(51,51,51);\">• Bus Pariwisata</span></p>', 'D4_Usaha_Perjalanan_Wisata.jpg', '2023-11-28 02:17:26', '2023-12-03 04:12:14');
INSERT INTO `prodis` (`id`, `id_jurusan`, `kode`, `nama`, `akreditasi`, `deskripsi`, `logo`, `created_at`, `updated_at`) VALUES
(35, 12, '3AK', 'D3 Akuntansi', 'A / Unggul', '<h2><span style=\"color:hsl(0,0%,0%);\"><strong>D3 Akuntansi (Akreditasi: Unggul)</strong></span></h2><p><span style=\"color:hsl(0,0%,0%);\">Program Studi DIII Akuntansi Politeknik Negeri Padang (PNP)&nbsp; didirikan pada tahun 1997 merupakan&nbsp; lembaga pendidikan tinggi negeri vokasi bidang akuntansi satu-satunya di Sumatera Barat. PS Akuntansi merupakan PS dengan jumlah peminat terbanyak di PNP sekarang ini. Hal ini terlihat dari keketatan persaingan calon mahasiswa baru antara yang diterima dengan yang mendaftar&nbsp;&nbsp; mencapai 1: 8, sehingga PS dapat menjaring calon mahasiswa baru yang lebih berkualitas. Proses pembelajaran di PS Akuntansi juga mengacu sepenuhnya pada filosofi pengajaran vokasional (Politeknik) yang lebih menekankan pada penguasaaan hardskill dan sofskill mahasiswa melalui<strong> </strong><i><strong>jam kuliah praktek (60%)</strong></i> dan <i><strong>jam kuliah teori (40%)</strong></i>. Sejalan dengan itu, kurikulum yang digunakan di PS dirancang sedemikian rupa dengan memperhatikan kebutuhan pemakai lulusan, mempertimbangkan masukan dari alumni PS serta perkembangan iptek. Hasilnya terlihat dari hasil pembelajaran (IPK) lulusan yang cukup tinggi yang berujung pada tingginya penyerapan lulusan di pasar kerja. Memanfaatkan kebutuhan akan Ahli Madya Akuntansi yang semakin tinggi di lapangan, PS Akuntansi terus berupaya memperluas aksesnya melalui kerjasama dengan pemakai lulusan.</span></p><h3><span style=\"color:hsl(0,0%,0%);\">Visi</span></h3><blockquote><p><span style=\"color:hsl(0,0%,0%);\"><i><strong>Menjadi institusi pendidikan vokasional unggulan bidang akuntansi program diploma III di Asia Tenggara.</strong></i></span></p></blockquote><h3><span style=\"color:hsl(0,0%,0%);\">Misi</span></h3><ol><li><span style=\"color:hsl(0,0%,0%);\">Menyelenggarakan dan mengembangkan pendidikan vokasi bidang akuntansi untuk menghasilkan lulusan yang kompeten, berintegritas, bermutu tinggi, berwawasan internasional, berjiwa kewirausahaan dan relevan dengan kebutuhan dunia kerja dan masyarakat sehingga mampu bersaing di tingkat nasional dan asia tenggara.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Mengimplementasikan <i>good university governance </i>dalam pengelolaan Program Studi</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian terapan serta pengembangan ilmu pengetahuan vokasi bidang akuntansi.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan pengabdian kepada masyarakat dan menjalin kerjasama dengan berbagai pihak yang memberikan kontribusi dalam pengembangan pendidikan vokasi, memecahkan permasalahan dan meningkatkan taraf hidup masyarakat di bidang akuntansi.</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\">Tujuan</span></h3><ol><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan lulusan yang memenuhi standar kompetensi akuntansi nasional dan internasional, berwawasan internasional, profesional, unggul, dan berintegritas, serta memiliki jiwa wirausaha.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menciptakan tata kelola program studi yang efisien, efektif, transparan dan akuntabel.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan penelitian terapan dan pengembangan ilmu pengetahuan vokasi bidang akuntansi yang menjadi rujukan nasional.</span></li><li><span style=\"color:hsl(0,0%,0%);\">Menghasilkan pengabdian masyarakat melalui pemanfaatan ilmu pengetahuan dan teknologi bidang akuntansi yang memberikan kontribusi dalam pengembangan pendidikan vokasi, memecahkan permasalahan dan meningkatkan kesejahteraan masyarakat serta terjalinnya kerjasama dengan berbagai pihak dalam rangka peningkatan kualitas pendidikan vokasi bidang akuntansi.</span></li></ol><h3><span style=\"color:hsl(0,0%,0%);\">Fasilitas</span></h3><p><span style=\"color:rgb(51,51,51);\">• Labor Komputer Akuntasi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Akuntansi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Kerja Anggaran Manufaktur</span><br><span style=\"color:rgb(51,51,51);\">• Labor Praktek Akuntansi Pemeriksaan</span><br><span style=\"color:rgb(51,51,51);\">• Labor Anggaran</span><br><span style=\"color:rgb(51,51,51);\">• Labor Sistem Informasi Akuntansi</span><br><span style=\"color:rgb(51,51,51);\">• Labor Anggaran Bank Mini</span></p>', 'D3_Akuntansi.jpg', '2023-11-28 02:18:57', '2023-12-03 04:10:30'),
(36, 12, '4AK', 'D4 Akuntansi', 'A / Unggul', '<h2><span style=\"color:hsl(0, 0%, 0%);\"><strong>D4 Akuntansi (Akreditasi: A)</strong></span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Program studi D-IV Akuntansi PNP merupakan salah satu program studi yang ada di jurusan Akuntansi. PS ini baru mulai beroperasi pada tahun 2009. PS D-IV Akuntansi sekarang disebut dengan program studi <strong>sarjana terapan akuntansi</strong>. Waktu pendidikan untuk PS ini adalah 8 semester.Prodi Sarjana Terapan Akuntansi ini mengacu sepenuhnya pada filosofi pengajaran vokasional dengan penerapan Kurikulum Berbasis Kompetensi (KBK) dan penyusunan kurikulum juga disesuaikan dengan KKNI (Kerangka Kualifikasi Nasional Indonesia) sehingga kurikulum dirancang dengan memperhatikan kebutuhan pemakai lulusan. Kerjasama dengan industri diwujudkan dalam bentuk MoU dengan industri pemakai lulusan seperti Kantor Akuntan Publik (KAP), BUMN, BUMD, dan instansi pemerintah serta swasta.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Visi</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Program Studi D-IV Akuntansi merupakan salah satu program studi di jurusan akuntansi yang melaksanakan pendidikan vokasi selama 4 tahun. Program studi D-IV Akuntansi merumuskan visinya sebagai berikut :</span></p><blockquote><p><span style=\"color:hsl(0, 0%, 0%);\"><i><strong>Menjadi Institusi Program Studi Diploma IV Akuntansi yang unggul dan berwawasan internasional.</strong></i></span></p></blockquote><p><span style=\"color:hsl(0, 0%, 0%);\">Untuk mencapai visi Program Studi D-IV Akuntansi, maka ditetapkan misi program studi yakni:</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Misi</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan pendidikan Diploma IV Akuntansi dalam rangka menghasilkan sarjana terapan akuntansi yang berkualitas, unggul, dan berintegritas.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melaksanakan penelitian terkait penerapan dan pengembangan ilmu pengetahuan dan teknologi serta meningkatkan publikasi ilmiah di bidang akuntansi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melaksanakan pengabdian kepada masyarakat dalam memecahkan permasalahan dan berkontribusi dalam meningkatkan taraf hidup masyarakat khususnya di bidang akuntansi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Melaksanakan <i>Good University Governance</i> dalam pengelolaan organisasi serta menjalin kerjasama dengan pihak lain dalam meningkatkan kompetensi lulusan dan kemajuan pendidikan bidang akuntansi.</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Tujuan</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan sarjana terapan akuntansi yang berkualitas, unggul, berintegritas, berdaya saing dan berwawasan internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan karya ilmiah dan Hak Kekayaan Intelektual (HaKI) di bidang akuntansi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan kegiatan pengabdian kepada masyarakat yang berbasis pada permasalahan dan kebutuhan masyarakat/industri serta berkontribusi dalam meningkatkan taraf hidup masyarakat khususnya di bidang akuntansi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menciptakan sistem manajemen mutu organisasi berbasis pada <i>Good University Governance</i></span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Fasilitas</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Labor Komputer Akuntasi</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Praktek Akuntansi</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Praktek Kerja Anggaran Manufaktur</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Praktek Akuntansi Pemeriksaan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Anggaran</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Sistem Informasi Akuntansi</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Labor Anggaran Bank Mini</span></p>', 'D4_Akuntansi.jpg', '2023-11-28 02:19:31', '2023-12-03 04:09:24'),
(37, 13, '3BI', 'D3 Bahasa Inggris', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0, 0%, 0%);\">D3 Bahasa Inggris</span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang memiliki kemampuan berfikir kritis, analitis dan memiliki rasa kepercayaan diri yang tinggi dan keterampilan berkomunikasi dalam bahasa Inggris dengan baik secara lisan dan tulisan untuk memenuhi kepentingan dunia usaha dan dunia industri, konsep, teknik dan keterampilan penerjemahan dari bahasa inggris ke bahasa indonesia dan sebaliknya,l serta keterampilan berbahasa inggris lisan dan tulisan dalm bidang komunikasi ( MC, Host, Spokesperson, News Reader, Reporter, Journalist,etc).</span></p><h3><br><span style=\"color:hsl(0, 0%, 0%);\">KOMPETENSI UTAMA:</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">1. Mampu menuangkan ide dalam Bahasa Inggris secara lisan dan tulisan dengan memperhatikan kaidah Bahasa Inggris.</span><br><span style=\"color:hsl(0, 0%, 0%);\">2. Mampu menggunakan Bahasa Inggris sebagai media komunikasi interaktif untuk membina hubungan sosial.</span><br><span style=\"color:hsl(0, 0%, 0%);\">3. Mampu membuat karya–karya kreatif dalam bidang Translation dan Broadcasting.</span><br><span style=\"color:hsl(0, 0%, 0%);\">4. Mampu melakukan negosiasi secara efektif dengan pelbagai pihak dalam usaha mengembangkan kehidupan kemasyarakatan yang lebih humanis.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Bidang Kerja :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">(Public Relation, Secretary, Receptionist, IT Operator, Telephone Operator, Tour Guide, Interpreter/ Translator, Customer Service, Travel Agent, Englisjh Course Owner and Instructor, MC, News Reader, Reporter, Journalist, Columnist, Host, Language Editor, Copy Writer, Movie Translator)</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Computer and Multimedia based English</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Language Laboratory</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Computer and Multimedia based English Teaching</span><br><span style=\"color:hsl(0, 0%, 0%);\">• English Club with Native Speakers</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Self Acces Center</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Library / Resources Centre</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Free Internet Acces (Hot Spot Areas)</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Studens Activity Centre</span></p>', 'D3_Bahasa_Inggris.jpg', '2023-11-28 02:21:01', '2023-12-03 04:21:47'),
(38, 13, '4BI', 'D4 Bahasa Inggris Komunukasi Bisnis', '- / Proses Akreditasi', '<h3><span style=\"color:hsl(0, 0%, 0%);\">D4 Bahasa Inggris Komunukasi Bisnis</span></h3><ul><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Penerjemah/juru bahasa (</strong><i><strong>translator/interpreter</strong></i><strong>) bidang bisnis.</strong></span></li></ul><p><span style=\"color:hsl(0, 0%, 0%);\">Mampu menerjemahkan teks di bidang bisnis, ekonomi, dan hukum bisnis dari Bahasa Inggris ke Bahasa Indonesia dan sebaliknya, serta mampu menjadi Juru Bahasa dalam seminar bisnis dan rapat bisnis.</span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Wirausaha di bidang Bahasa Inggris</strong></span></li></ul><p><span style=\"color:hsl(0, 0%, 0%);\">Mampu mengelola usaha di bidang Bahasa Inggris yaitu penerjemahan dan penjurubahasaan</span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Jurnalis media Berbahasa Inggris</strong></span></li></ul><p><span style=\"color:hsl(0, 0%, 0%);\">Mampu menulis berita, menyunting berita, meliput berita dalam Bahasa Inggris, dan menyampaikan berita (<i>anchor, reporter, host</i>) dalam Bahasa Inggris, serta menerjemahkan berita dari Bahasa Inggris ke dalam Bahasa Indonesia dan sebaliknya dengan baik.</span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\"><i><strong>Communicator in creative industry</strong></i><strong> (</strong><i><strong>Content writer, Copy writer, Content editor</strong></i><strong>)</strong></span></li></ul><p><span style=\"color:hsl(0, 0%, 0%);\">Mampu menulis konten, membuat konten, serta menyunting konten pada media komunikasi seperti TV, Radio dan Media Online dalam Bahasa Inggris dengan baik.</span></p><ul><li><span style=\"color:hsl(0, 0%, 0%);\"><i><strong>Public relation dan customer service officer</strong></i></span></li></ul><p><span style=\"color:hsl(0, 0%, 0%);\">Mampu menjadi <i>Public Relation Officer</i> dan <i>Customer Service Officer</i> yang fasih berbahasa Inggris dan mampu menyajikan presentasi produk dan <i>service </i>yang dihasilkan perusahaan dalam Bahasa Inggris.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Peluang Kerja Lulusan:</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Perusahaan Nasional dan Multinasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Biro Penerjemahan.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Media Digital</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Media Massa (Televisi &amp; Radio)</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Industri Pariwisata</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Mata Kuliah Utama</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Writing for Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Speaking for Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Listening for Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Reading for Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Computer Application for Business and Professionals</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Public Speaking for Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Critical Reading</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">English for e-business</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Business Document Translation</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Business Correspondence</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Translation for Media Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Intermediate Interpreting</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Content Writing for Business and Professional Communication</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Workshop on Communication in Creative Industry</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Leadership Management</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Fasilitas</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Bahasa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Multimedia</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Laboratorium Translation</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini TV</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Studio Mini Radio</span></li></ol>', 'D4_Bahasa_Inggris_Komunukasi_Bisnis.jpg', '2023-11-28 02:23:51', '2023-12-03 04:25:34'),
(39, 14, '3MI', 'D3 Manajemen Informatika', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0, 0%, 0%);\">D3 Manajemen Informatika</span></h2><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">D3 Manajemen Informatika&nbsp;didirikan pada&nbsp;tahun&nbsp;2005,&nbsp;dan&nbsp;terakreditasi&nbsp;dengan&nbsp;peringkat&nbsp;B&nbsp;berdasarkan&nbsp;Surat&nbsp;Keputusan Badan&nbsp;Akreditasi&nbsp;nasional Perguruan Tinggi (BAN-PT)&nbsp;Departemen&nbsp;Pendidikan&nbsp;dan kebudayaan&nbsp;republik&nbsp;Indonesia Surat&nbsp;Keputusan&nbsp;Nomor&nbsp;:1196/SK/BAN- PT/Akred/Dpl-III/XII/2015&nbsp;dengan nilai akreditasi 338.</span></p><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Arah kajian&nbsp;keilmuan dari&nbsp;program studi&nbsp;ini&nbsp;mencakup&nbsp;disiplin, proses, teknik&nbsp;dan&nbsp;alat&nbsp;bantu&nbsp;yang dibutuhkan&nbsp;dalam&nbsp;rekayasa&nbsp;perangkat&nbsp;lunak yang meliputi&nbsp;tahap&nbsp;perencanaan,&nbsp;pembangunan&nbsp;dan&nbsp;implementasi.&nbsp;Program&nbsp;studi&nbsp;D3 Manajemen Informatika yang merupakan kesatuan rencana belajar yang mengkaji, menerapkan, dan mengembangkan ilmu manajemen informatika yang melandasi&nbsp;rancang&nbsp;bangun&nbsp;sebuah&nbsp;sistem&nbsp;maupun&nbsp;aplikasi yang berdasarkan sistem&nbsp;informasi.</span></p><h3 style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Tujuan</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">Memiliki kemampuan membuat aplikasi jaringan komputer internet dan intranet dan mengelola sistem informasi berbasis LAN (Local Area Network) dan Internet untuk berbagai organisasi perkantoran dan bisnis. Menguasai berbagai program aplikasi (programmer)</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemrograman</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Jaringan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Basis Data</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Digital</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemrograman</span></p>', 'D3_Manajemen_Informatika.png', '2023-11-28 02:24:27', '2023-12-03 04:28:38'),
(40, 14, '3TK', 'D3 Teknik Komputer', 'B / Baik Sekali', '<h2><span style=\"color:hsl(0, 0%, 0%);\">D3 Teknik Komputer</span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Memiliki kemampuan membangun jaringan komputer internet dan intranet. Mampu memilih model dan infra struktur jaringan untuk berbagai keperluan yang berbeda. Mampu melakukan perawatan, perbaikan sistem jaringan komputer. Mampu menjadi administrator dan programmer.</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Visi</strong></span></h3><blockquote><p>&nbsp;</p><p><span style=\"color:hsl(0, 0%, 0%);\"><i>Menjadi institusi pendidikan vokasional di bidang Teknik Komputer yang berkontribusi pada pembangunan nasional Indonesia dan berwawasan internasional</i></span></p></blockquote><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Misi</strong></span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan pendidikan vokasi dibidang teknik Komputer yang sesuai dengan perkembangan ilmu pengetahuan dan teknologi yang berwawasan internasional.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menyelenggarakan penelitian yang inovatif dan adaptif di bidang Teknik Komputer Jaringan untuk pengembangan ilmu pengetahuan dan teknologi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menerapkan ilmu pengetahuan dan teknologi dalam rangka memecahkan masalah dan meningkatkan taraf hidup masyarakat di bidang Teknik Komputer Jaringan.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menjalin kerja sama yang produktif dan berkelanjutan dengan lembaga pendidikan, pemerintahan, dan dunia usaha di tingkat nasional dan internasional di bidang Teknik Komputer jaringan</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Tujuan</strong></span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan lulusan yang kompeten di bidang Teknik Komputer Jaringan, berdaya saing antar bangsa, bermartabat dan bertaqwa kepada Tuhan Yang Maha Esa</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan penelitian di bidang Teknik Komputer Jaringan yang bermanfaat dalam pengembangan dan penerapan ilmu pengetahuan dan teknologi, pencapaian hak atas kekayaan intelektual (HKI).</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan karya pengabdian kepada masyarakat yang berbasis pada Teknik Komputer Jaringan untuk meningkatkan kesejahteraan masyarakat</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Menghasilkan kerja sama dengan berbagai pihak di bidang Teknik Komputer Jaringan, baik dalam maupun luar negeri yang saling menguntungkan</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Jaringan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Bengkel Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Basis Data</span><br><span style=\"color:hsl(0, 0%, 0%);\">•Lab. Digital</span></p>', 'D3_Teknik_Komputer.png', '2023-11-28 02:25:20', '2023-12-03 04:30:43'),
(41, 14, '4TRPL', 'D4 Teknologi Rekayasa Perangkat Lunak', 'C / Baik', '<h2><span style=\"color:hsl(0, 0%, 0%);\">D4 Teknologi Rekayasa Perangkat Lunak</span></h2><p><span style=\"color:hsl(0, 0%, 0%);\">Memiliki kemampuan membangun jaringan komputer internet dan intranet dan membuat aplikasi dan mengelola sistem informasi berbasis LAN (Local Area Network) dan Internet untuk berbagai organisasi perkantoran dan bisnis. Menguasai berbagai program aplikasi (programmer)</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>DESKRIPSI PRODI</strong></span></h3><p style=\"text-align:justify;\"><span style=\"color:hsl(0, 0%, 0%);\">Program studi D4 Teknologi Rekayasa Perangkat Lunak pada jurusan Teknologi Informasi memiliki latar belakang yang kuat dalam menghasilkan tenaga ahli di bidang pengembangan perangkat lunak. Di era informasi digital dan teknologi yang terus berkembang pesat, kebutuhan akan perangkat lunak berkualitas tinggi semakin meningkat. Oleh karena itu, program studi ini dirancang untuk memberikan pemahaman mendalam tentang konsep-konsep dasar teknologi rekayasa perangkat lunak, metodologi pengembangan, kebutuhan, analisis sistem desain, pengujian perangkat lunak, dan manajemen proyek perangkat lunak. Aspek-aspek latar belakang dari program studi D4 Teknologi Rekayasa Perangkat Lunak mencakup beberapa hal yang mendasari pendirian program ini.</span></p><p><span style=\"color:hsl(0, 0%, 0%);\">Berikut adalah beberapa aspek kunci :</span></p><ol><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kebutuhan Industri</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Permintaan akan profesional di bidang rekayasa perangkat lunak terus meningkat seiring dengan perkembangan teknologi informasi. Perusahaan-perusahaan membutuhkan pengembang perangkat lunak yang terampil untuk mengembangkan solusi teknologi yang inovatif dan berkualitas tinggi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kompleksitas Perangkat Lunak</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Perangkat lunak modern semakin kompleks dan terintegrasi dengan berbagai sistem. Oleh karena itu, dibutuhkan pemahaman mendalam tentang metodologi pengembangan perangkat lunak yang efektif untuk menghadapi tantangan ini.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kualitas dan Keamanan</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Kualitas perangkat lunak sangat penting untuk menghindari masalah dan kerentanan yang dapat merugikan pengguna. Program studi ini menekankan pada praktik pengembangan yang berfokus pada kualitas, pengujian, dan keamanan perangkat lunak.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Teknologi Terkini</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program ini mencakup pemahaman tentang teknologi terkini dalam industri perangkat lunak, seperti Agile, DevOps, teknologi cloud, pengembangan aplikasi mobile, dan keamanan siber. Mahasiswa diajarkan tentang tren terbaru untuk mempersiapkan mereka menghadapi tantangan masa depan.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Kerja Sama Industri</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Kerja sama dengan industri membantu program studi memahami kebutuhan aktual pasar kerja. Ini juga memberikan kesempatan bagi mahasiswa untuk berinteraksi dengan praktisi industri, mengikuti magang, dan menerapkan pengetahuan mereka dalam lingkungan nyata.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengembangan Keterampilan Soft Skills</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Selain keterampilan teknis, program ini juga menekankan pengembangan keterampilan interpersonal, komunikasi, dan pemecahan masalah. Keterampilan ini penting dalam kolaborasi tim dan dalam beradaptasi dengan perubahan teknologi.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengalaman Praktis</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program ini seringkali menyertakan proyek-proyek praktis dalam kurikulum, memungkinkan mahasiswa untuk mengembangkan perangkat lunak nyata dan mendapatkan pengalaman langsung dalam pengembangan perangkat lunak.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pemahaman Bisnis</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Mahasiswa juga diajarkan tentang aspek-aspek bisnis dalam pengembangan perangkat lunak, termasuk analisis kebutuhan pengguna, manajemen proyek, dan pengelolaan sumber daya.</span></li><li><span style=\"color:hsl(0, 0%, 0%);\"><strong>Pengajaran Oleh Ahli</strong></span><br><span style=\"color:hsl(0, 0%, 0%);\">Program studi ini biasanya diampu oleh dosen-dosen yang ahli di bidang teknologi rekayasa perangkat lunak, memberikan wawasan mendalam kepada mahasiswa.</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\">Visi</span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">“Menjadi program studi unggul dalam bidang teknologi rekayasa perangkat lunak yang bermartabat dan berwawasan internasional”</span></p><h3><span style=\"color:hsl(0, 0%, 0%);\">Misi</span></h3><ol><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan sumber daya manusia di bidang teknologi rekayasa perangkat lunak</span></li><li><span style=\"color:hsl(0, 0%, 0%);\">Mengembangkan inovasi teknologi rekayasa perangkat lunak</span></li></ol><h3><span style=\"color:hsl(0, 0%, 0%);\"><strong>Fasilitas Pendukung :</strong></span></h3><p><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemograman</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Komputer</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Jaringan</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Basis Data</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Digital</span><br><span style=\"color:hsl(0, 0%, 0%);\">• Lab. Pemrograman</span></p>', 'D4_Teknologi_Rekayasa_Perangkat_Lunak.png', '2023-11-28 02:26:27', '2023-12-03 04:34:26');

